insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('100','CAPITAL SOCIAL','N',0,'CAPITAL SOCIAL',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Capital escriturado en las sociedades que revistan forma mercantil, salvo cuando atendiendo a las características económicas de la emisión deba contabilizarse como pasivo financiero. \r\n\r\nHasta el momento de su inscripción registral y tratándose de sociedades anónimas, sociedades de responsabilidad limitada y comanditarias por acciones, la emisión y suscripción o asunción, de acciones o participaciones, respectivamente, se registrará de conformidad con lo dispuesto en el subgrupo 19. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará por el capital inicial y las sucesivas ampliaciones, en el momento de su inscripción en el Registro Mercantil, con cargo a la cuenta 194. \r\n\r\nb) Se cargará por las reducciones del mismo y a la extinción de la sociedad. \r\n\r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
