insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('101','FONDO SOCIAL','N',0,'FONDO SOCIAL',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Capital de las entidades sin forma mercantil. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará por el capital inicial y las sucesivas ampliaciones, en el momento de su inscripción en el Registro Mercantil, con cargo a la cuenta 194. \r\n\r\nb) Se cargará por las reducciones del mismo y a la extinción de la sociedad. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('102','CAPITAL','N',0,'CAPITAL',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Corresponde a las empresas individuales. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará: \r\n    a1) Por el capital inicial. \r\n    a2) Por los resultados positivos capitalizados, con cargo a la cuenta 129. \r\n\r\nb) Se cargará: \r\n    b1) Por la cesión de los negocios o el cese de los mismos. \r\n    b2) Por los resultados negativos que no se carguen para su amortización en la cuenta 121, con abono a la             cuenta 129. \r\n\r\nc) Se abonará o cargará, al final del ejercicio, por el saldo de la cuenta 550, con cargo o abono a dicha     cuenta. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('103','SOCIOS POR DESEMBOLSOS NO EXIGIDOS','N',0,'SOCIOS POR DESEMBOLSOS NO EXIGIDOS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Capital social escriturado pendiente de desembolso, excepto los desembolsos no exigidos correspondientes a los instrumentos financieros cuya calificación contable sea la de pasivo financiero. \r\n\r\nFigurarán en el patrimonio neto, con signo negativo, minorando la partida de capital social, excepto las cantidades que correspondan a capital emitido pendiente de inscripción que figurarán minorando la partida del pasivo corriente en la que éste se incluye.\r\n\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('1030','SOCIOS POR DESEMBOLSOS NO EXIGIDOS, CAPITAL SOCIAL','N',0,'SOCIOS POR DESEMBOLSOS NO EXIGIDOS, CAPITAL SOCIAL',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se cargará por el valor nominal no desembolsado de las acciones suscritas o participaciones en el momento de su inscripcion en el Registro Mercantil, con abono a la cuenta 1034.\r\n\r\nb) Se abonará a medida que se vayan exigiendo los desembolsos, con cargo a la cuenta 5580.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('1034','SOCIOS POR DESEMBOLSOS NO EXIGIDOS, CAPITAL PDTE.INSCRIPCION','N',0,'SOCIOS POR DESEMBOLSOS NO EXIGIDOS, CAPITAL PDTE.INSCRIPCION',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se cargará por el valor nomimal no desembolsado de las acciones suscritas o participaciones asumidas, con abono, generalmente, a la cuenta 190 o 192.\r\n\r\nb) Se abonará en el momento de la inscripción en el Registro Mercantil, cor gargo a la cuenta 1030.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('104','SOCIOS POR APORTACIONES NO DINERARIAS PENDIENTES','N',0,'SOCIOS POR APORTACIONES NO DINERARIAS PENDIENTES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Capital social escriturado pendiente de desembolso que corresponde a aportaciones no dinerarias, excepto las aportaciones pendientes que correspondan a instrumentos financieros cuya calificación contable sea la de pasivo financiero. \r\n\r\nFigurarán en el patrimonio neto, con signo negativo, minorando la partida de capital social, excepto las cantidades que correspondan a capital emitido pendiente de inscripción que figurarán minorando la partida del pasivo corriente en la que este se incluye.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('1040','SOCIOS POR APORTACIONES NO DINERARIAS PDTES, CAPITAL SOCIAL','N',0,'SOCIOS POR APORTACIONES NO DINERARIAS PDTES, CAPITAL SOCIAL',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se cargará pro el valor nominal no desembolsado de las acciones suscritas o participaciones en el momento de su inscripción en el Registro Mercantil, con abono a la cuenta 1044.\r\n\r\nb) Se abonará cuando se realicen los desembolsos, con cargo a las cuentas representativas de los bienes no dinerarios aportados.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('1044','SOCIOS APORTACIONES NO DINERARIAS PDTES., CAPITAL PDTE. INSC','N',0,'SOCIOS APORTACIONES NO DINERARIAS PDTES., CAPITAL PDTE. INSC',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'a) Se cargarán por el valor nominal no desembolsado de las acciones suscritas o participaciones asumidas,     con abono, generalmente, a la cuenta 190 ó 192. \r\n\r\nb) Se abonará en el momento de la inscripción en el Registro Mercantil, con cargo a la cuenta 1040.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('108','ACCIONES O PARTICIPACIONES PROPIAS EN SITUACIONES ESPECIALES','N',0,'ACCIONES O PARTICIPACIONES PROPIAS EN SITUACIONES ESPECIALES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Acciones o participaciones propias adquiridas por la empresa (sección cuarta del capítulo IV del Texto Refundido de la Ley de Sociedades Anónimas y de la Ley de Sociedades de Responsabilidad Limitada). \r\nFigurarán en el patrimonio neto, con signo negativo. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargarán por el importe de la adquisición de las acciones o participaciones, con abono, generalmente, a     cuentas del subgrupo 57. \r\n\r\nb) Se abonarán: \r\n    b1) Por la enajenación de las acciones o participaciones, con cargo, generalmente, a cuentas del subgrupo           57. La diferencia entre la cantidad obtenida en la enajenación de las acciones o participaciones propias           y su valor contable se cargará o abonará, según proceda, a cuentas del subgrupo 11. \r\n    b2) Por la reducción de capital, con cargo a la cuenta 100 por el importe del nominal de las acciones o                   participaciones. La diferencia entre el importe de adquisición de las acciones o participaciones y su           valor nominal se cargará o abonará, según proceda, a cuentas del subgrupo 11. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('1080','ACCIONES O PARTICIPACIONES PROPIAS EN SITUACIONES ESPECIALES','N',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('10800','ACCIONES O PARTICIPACIONES PROPIAS EN SITUACIONES ESPECIALES','N',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('109','ACCIONES O PARTICIPACIONES PROPIAS PARA REDUCCION CAPITAL','N',0,'ACCIONES O PARTICIPACIONES PROPIAS PARA REDUCCION CAPITAL',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Acciones o participaciones propias adquiridas por la empresa en ejecución de un acuerdo de reducción de capital adoptado por la Junta General (art. 170 del Texto Refundido de la Ley de Sociedades Anónimas y art. 40 de la Ley de Sociedades de Responsabilidad Limitada). \r\n\r\nFigurarán en el patrimonio neto, con signo negativo. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargarán por el importe de la adquisición de las acciones o participaciones, con abono, generalmente, a     cuentas del subgrupo 57. \r\n\r\nb) Se abonarán por la reducción de capital, con cargo a la cuenta 100 por el importe del nominal de las     acciones o participaciones. La diferencia entre el importe de adquisición de las acciones o participaciones y     su valor nominal se cargará o abonará, según proceda, a cuentas del subgrupo 11. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('11','RESERVAS','N',0,'RESERVAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Las cuentas de este subgrupo figurarán en el patrimonio neto del balance, formando parte de los fondos propios.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('110','PRIMA DE EMISION O ASUNCION','N',0,'PRIMA DE EMISION O ASUNCION',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Aportación realizada por los accionistas o socios en el caso de emisión y colocación de acciones o participaciones a un precio superior a su valor nominal. En particular, incluye las diferencias que pudieran surgir entre los valores de escritura y los valores por los que deben registrarse los bienes recibidos en concepto de aportación no dineraria, de acuerdo con lo dispuesto en las normas de registro y valoración. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará, con cargo, generalmente, a la cuenta 194. \r\n\r\nb) Se cargará por la disposición que de la prima pueda realizarse. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('111','OTROS INSTRUMENTOS DE PATRIMONIO NETO','N',0,'OTROS INSTRUMENTOS DE PATRIMONIO NETO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('1110','PATRIMONIO NETO POR EMISION DE INST. FINANCIEROS COMPUESTOS','N',0,'PATRIMONIO NETO POR EMISION DE INST. FINANCIEROS COMPUESTOS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Componenten del patrimonio neto que surge por la emisión de un intrumento financiero compuesto. En particular, por la emisión de obligaciones convertibles en acciones.\r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se abonará por el componente de patrimonio neto del instrumento financiero, cor cargo, generalmente, a cuentas del subgrupo 57.\r\n\r\nb) Se cargará con abono a las cuentas 100 o 110, cuando se produzca la conversión.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('1111','RESTO DE INSTRUMENTOS DE PATRIMONIO NETO','N',0,'RESTO DE INSTRUMENTOS DE PATRIMONIO NETO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Esta cuenta recoge el restoa de instrumentos de patrimonio neto que no tienen cabida en otras, tales como las opciones sobre acciones propias.\r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se abonará por el importe de instrumento calificado como patrimonio neto con cargo, generalmente, a cuentas del grupo 6 o del subgrupo 57.\r\n\r\nb) Se cargará cuando se entreguen otros instrumentos de patrimonio neto, con abono a la cuenta de patrimonio neto que corresponda.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('112','RESERVA LEGAL','N',0,'RESERVA LEGAL',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Esta cuenta registrará la reserva establecida por el artículo 214 del Texto Refundido de la Ley de Sociedades Anónimas. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará, generalmente, con cargo a la cuenta 129. \r\n\r\nb) Se cargará por la disposición que se haga de esta reserva\r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
