insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('114','RESERVAS ESPECIALES','N',0,'RESERVAS ESPECIALES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Las establecidas por cualquier disposición legal con carácter obligatorio, distintas de las incluidas en otras cuentas de este subgrupo. \r\n\r\nEn particular, se incluye la reserva por participaciones recíprocas establecida en el artículo 84 del Texto Refundido de la Ley de Sociedades Anónimas. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('1140','RESERVAS PARA ACCIONES O PARTICIPACIONES SOCIEDAD DOMINANTE','N',0,'RESERVAS PARA ACCIONES O PARTICIPACIONES SOCIEDAD DOMINANTE',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Las constituidas obligatoriamente en caso de adquisición de acciones o participaciones de la Sociedad dominante y en tanto éstas no sean enajenadas (artículo 79.3ª del Texto Refundido de la Ley de Sociedades Anónimas y artículo 40.bis de la Ley de Sociedades de Responsabilidad Limitada). Esta cuenta también recogerá, con el debido desglose en cuentas de cinco cifras, las reservas que deban ser constituidas en caso de aceptación de las acciones de la sociedad dominante en garantía (artículo 80.1 del Texto Refundido de la Ley de Sociedades Anónimas). Mientras duren estas situaciones dichas reservas serán indisponibles. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará por el importe de adquisición de las acciones o participaciones de la sociedad dominante o por     el importe a que ascienda la cantidad garantizada mediante sus acciones, con cargo a cualesquiera de las     cuentas de reservas disponibles, o a la cuenta 129. \r\n\r\nb) Se cargará, por el mismo importe, cuando dichas acciones o participaciones se enajenen o cuando cese la     garantía, con abono a la cuenta 113. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('1141','RESERVAS ESTATUTARIAS','N',0,'RESERVAS ESTATUTARIAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Son las establecidas en los estatutos de la sociedad. \r\n\r\nSu movimiento es análogo al señalado para la cuenta 112. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('1142','RESERVA POR CAPITAL AMORTIZADO','N',0,'RESERVA POR CAPITAL AMORTIZADO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Nominal de las acciones o participaciones de la propia empresa adquiridas por ésta y amortizadas con cargo a beneficios o a reservas disponibles. También se incluirá el nominal de las acciones o participaciones de la propia empresa amortizadas, si han sido adquiridas por ésta a título gratuito. La dotación y disponibilidad de esta cuenta se regirá por lo establecido en el artículo 167 del Texto Refundido de la Ley de Sociedades Anónimas y 80 de la Ley de Sociedades de Responsabilidad Limitada, respectivamente. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará con cargo a cualesquiera de las cuentas de reservas disponibles, o a la cuenta 129. \r\n\r\nb) Se cargará por las reducciones que de la misma se realicen. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('1143','RESERVA POR FONDO DE COMERCIO','N',0,'RESERVA POR FONDO DE COMERCIO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'La constituida obligatoriamente en caso de que exista fono de comercio en el activo del balance (artículo 213.4 del Texto Refundido de la Ley de las Sociedades Anóminas). Mientras dure esta situación esta reserva sera indisponible.\r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se abonará con cargo a cualesquiera de las cuentas de reservas disponibles, o a la cuenta 129.\r\n\r\nb) Se cargará por la disposición que pueda hacerse de esta reserva.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
