insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('115','RESERVAS POR PERDIDAS Y GANANCIAS ACTUARIALES Y OTROS AJUSTE','N',0,'RESERVAS POR PERDIDAS Y GANANCIAS ACTUARIALES Y OTROS AJUSTE',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Componente del patrimonio neto que suerge del reconocimiento de pérdidas y ganancias actuariales y de los ajustes en el valor de los activos por retribuciones postempleo al personal de prestación definidad, de acuerdo con lo dispuesto en las normas de registro y valoración.\r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se abonará:\r\n    a1) Al cierre del ejercicio, por el importe de las ganancia reconocida, con cargo a cuentas del subgrupo 95.\r\n    a2) Por el gsto por impuesto sobre benficios relacionado con estos aspectos, con cargo a las cuentas del           grupo 83.\r\n\r\nb) Se cargará:\r\n    b1) Al cierre del ejercicio, por el importe de la pérdida reconocida, con abono a las cuentas del subgrupo           85.\r\n    b2) Por el gasto por impuesto sobre beneficios relacionado con estos aspectos, con abono a las cuentas           del subgrupo 83.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
