insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('13','SUBVENC., DONACIONES, LEGADOS Y OTROS AJUSTES DE PATRIMONIO','N',0,'SUBVENC., DONACIONES, LEGADOS Y OTROS AJUSTES DE PATRIMONIO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Subvenciones donaciones y legados, no reintegrables, otorgados por terceros distintos a los socios o propietarios, recibidos por la empresa y contabilizados directamente en el patrimonio neto, hasta que de conformidad con lo previsto en las normas de registro y valoración, se produzca su transferencia o imputación a la cuenta de pérdidas y ganancias. \r\n\r\nLas cuentas de este subgrupo figurarán en el patrimonio neto. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('130','SUBVENCIONES OFICIALES CAPITAL','N',0,'SUBVENCIONES OFICIALES CAPITAL',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Las concedidas por las Administraciones Públicas, tanto nacionales como internacionales, para el establecimiento o estructura fija de la empresa (activos no corrientes) cuando no sean reintegrables, de acuerdo con los criterios establecidos en las normas de registro y valoración. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará: \r\n    a1) Por la subvención concedida a la empresa con cargo, generalmente, a cuentas del subgrupo 47 ó 57. \r\n    a2) Por las deudas a largo plazo que se transforman en subvenciones, con cargo a la cuenta 172. \r\n    a3) Por el gasto por impuesto diferido vinculado a la subvención imputada a la cuenta de pérdidas y           ganancias, con cargo a la cuenta 479. \r\n\r\nb) Se cargará: \r\n    b1) Al cierre del ejercicio, por la parte de la subvención imputada a la cuenta de pérdidas y ganancias, con           abono a la cuenta 746. \r\n    b2) Por la cuota a ingresar por impuesto sobre beneficios vinculado a la subvención registrada directamente           en el patrimonio neto, con abono a la cuenta 4752. \r\n    b3) Por el gasto por impuesto diferido asociado a la subvención registrada directamente en el patrimonio           neto, con abono a la cuenta 479. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('131','DONACIONES Y LEGADOS CAPITAL','N',0,'DONACIONES Y LEGADOS CAPITAL',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Las donaciones y legados concedidos por empresas o particulares, para el establecimiento o estructura fija de la empresa (activos no corrientes) cuando no sean reintegrables, de acuerdo con los criterios establecidos en las normas de registro y valoración. \r\n\r\nSu movimiento es análogo al señalado para la cuenta 130. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('132','OTRAS SUBVENCIONES, DONACIONES Y LEGADOS','N',0,'OTRAS SUBVENCIONES, DONACIONES Y LEGADOS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Las subvenciones, donaciones y legados concedidos que no figuran en las cuentas anteriores, cuando no sean reintegrables, y se encuentren pendientes de imputar al resultado de acuerdo con los criterios establecidos en las normas de registro y valoración. Es el caso de las subvenciones concedidas para financiar programas que generarán gastos futuros. \r\n\r\nSu movimiento es análogo al señalado para la cuenta 130. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('133','AJUSTE POR VALORACION EN ACTIVOS FINANCIEROS PARA LA VENTA','N',0,'AJUSTE POR VALORACION EN ACTIVOS FINANCIEROS PARA LA VENTA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ajustes producidos por la valoración a valor razonable de los instrumentos financieros con\r\ncambios en patrimonio neto. En particular, los producidos en activos financieros clasificados en\r\nla categoría de disponibles para la venta, de acuerdo con la norma de registro y valoración\r\nrelativa a los instrumentos financieros.\r\n\r\nCon carácter general, el movimiento de las cuentas citadas de cuatro dígitos es el siguiente:\r\n\r\na) Se abonará:\r\n    a1) Al cierre del ejercicio, para determinar el saldo que debe figurar en el balance, con cargo a las           correspondientes cuentas de los subgrupos 90 y 99.\r\n    a2) Por el gasto por impuesto sobre beneficios originado por la valoración a valor razonable de los                           instrumentos financieros, con cargo a las cuentas del subgrupo 83.\r\n    a3) Por las variaciones de valor negativas imputadas directamente al patrimonio neto en activos financieros           disponibles para la venta, cuando se haya producido una combinación de negocios por etapas, con           cargo a la cuenta 113.\r\n\r\nb) Se cargará:\r\n    b1) Al cierre del ejercicio, para determinar el saldo que debe figurar en el balance, con abono a las           correspondientes cuentas de los subgrupos 80 y 89.\r\n    b2) Por el gasto por impuesto sobre beneficios originado por la valoración a valor razonable de los           instrumentos financieros, con abono a las cuentas del subgrupo 83.\r\n    b3) Por las variaciones de valor positivas imputadas directamente al patrimonio neto en activos financieros           disponibles para la venta, cuando se haya producido una combinación de negocios por etapas, con           abono a la cuenta 113.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('134','OPERACIONES DE COBERTURA','N',0,'OPERACIONES DE COBERTURA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Importe de la pérdida o ganancia del instrumento de cobertura que se haya determinado como\r\ncobertura eficaz, en el caso de coberturas de flujos de efectivo o de cobertura de una inversión\r\nneta en un negocio en el extranjero.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('1340','COBERTURA DE FLUJOS DE EFECTIVO','N',0,'COBERTURA DE FLUJOS DE EFECTIVO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se abonará:\r\n\r\n    a1) Al cierre del ejercicio, por los beneficios por coberturos de flujos de efectivo, con cargo a la cuenta 910.\r\n    a2) Al cierre del ejercicio, por las pérdidas transferidas en coberturas de flujos de efectivo con cargo a la           cuenta 912.\r\n    a3) Por el gasto por impueto sobre beneficios que surja en estas operaciones, con cargo a las cuentas del           subgrupo 83.\r\n\r\nb) Se cargará:\r\n    b1) Al cierre del ejercicio, por las pérdidas por coberturas de flujos de efectivo, con abono a la cuenta 810.\r\n    b2) Al cierre del ejercicio, por los benefcios transferidos en coberturas de flujos de efectivo, con abono a la           cuenta 812.\r\n    b3) Por el gasto por impuesto sobre beneficios que surja en estas operaciones, con abono a las cuentas del           subgrupo 83.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('1341','COBERTURA DE UNA INVERSION NETA EN UN NEGOCIO EN EXTRANJERO','N',0,'COBERTURA DE UNA INVERSION NETA EN UN NEGOCIO EN EXTRANJERO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'La cobertura de una inversión neta en un negocio en el extrajero, incluye la cobertura de una partida monetaria que se conisdere como parte de la citada inversión neta, por no contemplarse ni ser probable la liquidación de dicha partida en un futuro previsible en los términos previstos en las normas del registro y valoración.\r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se abonará:\r\n\r\n    a1) Al cierre del ejercicio, por los beneficios por coberturos de flujos de efectivo, con cargo a la cuenta 910.\r\n    a2) Al cierre del ejercicio, por las pérdidas transferidas en coberturas de flujos de efectivo con cargo a la           cuenta 912.\r\n    a3) Por el gasto por impueto sobre beneficios que surja en estas operaciones, con cargo a las cuentas del           subgrupo 83.\r\n\r\nb) Se cargará:\r\n    b1) Al cierre del ejercicio, por las pérdidas por coberturas de flujos de efectivo, con abono a la cuenta 810.\r\n    b2) Al cierre del ejercicio, por los benefcios transferidos en coberturas de flujos de efectivo, con abono a la           cuenta 812.\r\n    b3) Por el gasto por impuesto sobre beneficios que surja en estas operaciones, con abono a las cuentas del           subgrupo 83.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('135','DIFERENCIAS DE CONVERSION','N',0,'DIFERENCIAS DE CONVERSION',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Diferencia que surge al convertir a la moneda de presentación, euro, las partidas del balance y de\r\nla cuenta de pérdidas y ganancias en el caso de que la moneda funcional sea distinta de la\r\nmoneda de presentación.\r\n\r\nCon carácter general, su movimiento es el siguiente:\r\n\r\na) Se abonará:\r\n    a1) Al cierre del ejercicio, para determinar el saldo que debe figurar en el balance, con cargo a la cuenta           correspondiente del subgrupo 92.\r\n    a2) Por el gasto por impuesto sobre beneficios vinculado a la diferencia de conversión, con cargo a las           cuentas del subgrupo 83.\r\n\r\nb) Se cargará:\r\n    b1) Al cierre del ejercicio, para determinar el saldo que debe figurar en el balance, con abono a la cuenta          correspondiente del subgrupo 82.\r\n    b2) Por el gasto por impuesto sobre beneficios vinculado a la diferencia de conversión, con abono a las          cuentas del subgrupo 83.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('136','AJUSTES POR VALORACION ACTIVOS NO CORRIENTES PARA LA VENTA','N',0,'AJUSTES POR VALORACION ACTIVOS NO CORRIENTES PARA LA VENTA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ajustes por valor razonable de activos no corrientes clasificados como mantenidos para la venta,\r\ny de activos y pasivos directamente asociados, clasificados como grupos enajenables de elementos mantenidos para la venta, cuyas variaciones de valor, previamente a su clasificación\r\nen este categoría, ya se imputaban a otra cuenta del subgrupo 13.\r\n\r\nCon carácter general, su movimiento es el siguiente:\r\n\r\na) En el momento de su clasificación en esta categoría, se abonará o cargará, por la variación de valor     imputada directamente al patrimonio neto hasta dicho momento, con cargo o abono, a las correspondientes     cuentas de este subgrupo 13.\r\nb) Posteriormente, se abonará o cargará, por la variación en el valor de los activos no corrientes mantenidos     para la venta, y de activos y pasivos directamente asociados clasificados como grupos enajenables de         elementos mantenidos para la venta, con cargo o abono, respectivamente, a las cuentas representativas     de los citados elementos\r\npatrimoniales.\r\nc) Los motivos de cargo y abono correspondientes al efecto impositivo, son análogos a\r\nlos señaladas para la cuenta 133.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('137','INGRESOS FISCALES A DISTRIBUIR EN VARIOS EJERCICIOS','N',0,'INGRESOS FISCALES A DISTRIBUIR EN VARIOS EJERCICIOS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ventajas fiscales materializadas en diferencias permanentes y deducciones y bonificaciones que, por tener una naturaleza económica asimilable a las subvenciones, son objeto de imputación a la cuenta de pérdidas y ganancias en varios ejercicios. \r\n\r\nA estos efectos, las diferencias permanentes se materializan, con carácter general, en ingresos que no se incorporan en la determinación de la base imponible del impuesto sobre beneficios y que no revierten en períodos posteriores. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('1370','INGRESOS FISCALES POR DIFERENCIAS PERMANENTES A DISTRIBUIR','N',0,'INGRESOS FISCALES POR DIFERENCIAS PERMANENTES A DISTRIBUIR',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'a) Se abonará, generalmente, con cargo a la cuenta 6301, por el importe del efecto impositivo de las     diferencias permanentes a imputar en varios ejercicios. \r\n\r\nb) Se cargará, generalmente, con abono a la cuenta 6301, por la parte correspondiente a imputar a la cuenta     de pérdidas y ganancias en el ejercicio, de forma correlacionada con la depreciación del activo que motive     la diferencia permanente. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('1371','INGRESOS FISCALES POR DEDUCCIONES Y BONIFICACIONES A DISTRIB','N',0,'INGRESOS FISCALES POR DEDUCCIONES Y BONIFICACIONES A DISTRIB',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'a) Se abonará, generalmente, con cargo a la cuenta 6301, por el importe del efecto impositivo de las     diferencias permanentes a imputar en varios ejercicios. \r\n\r\nb) Se cargará, generalmente, con abono a la cuenta 6301, por la parte correspondiente a imputar a la cuenta     de pérdidas y ganancias en el ejercicio, de forma correlacionada con la depreciación del activo que motive     la diferencia permanente. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('14','PROVISIONES','N',0,'PROVISIONES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Las que tienen por objeto el reconocimiento contable de pasivos no financieros de carácter no corriente que surgen de obligaciones expresas o tácitas, claramente especificados en cuanto a su naturaleza, pero que, en la fecha de cierre del ejercicio, son indeterminados en cuanto a su importe exacto o a la fecha en que se producirán. \r\n\r\nLas cuentas de este subgrupo figurarán en el pasivo no corriente del balance. \r\n\r\nLa parte de las provisiones cuya cancelación se prevea en el corto plazo deberá figurar en el pasivo corriente del balance, en el epígrafe \"Provisiones a corto plazo\"; a estos efectos se traspasará el importe que representen las provisiones con vencimiento a corto a las cuentas de cuatro cifras correspondientes de la cuenta 529. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('140','PROVISIONES POR RETRIBUCIONES A LARGO PLAZO AL PERSONAL','N',0,'PROVISIONES POR RETRIBUCIONES A LARGO PLAZO AL PERSONAL',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Obligaciones legales, contractuales o implícitas con el personal de la empresa, distintas de las recogidas en la cuenta 147, sobre las que existe incertidumbre acerca de su cuantía o vencimiento, tales como retribuciones a largo plazo de prestación definida, prestaciones por incapacidad o indemnizaciones por cese de contrato.\r\n\r\nLa provisión correspondiente a retribuciones a largo plazo de prestación definida se cuantificará teniendo en cuenta los eventuales activos afectos, en los términos recogidos en las normas de registro y valoración.\r\n\r\nSi de la aplicación de lo dispuesto en esta norma surgiese un activo, la empresa creará la correspondiente cuenta en el grupo 2 que figurará en el activo no corriente del balance, en la partida \"otras inversiones\".\r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se abonará:\r\n     a1) Por las estimaciones de los devengos anuales, con cargo a cuentas del subgrupo 64.\r\n     a2) Por el reconocimiento de pérdidas actuariales, con cargo a la cuenta 850, en caso de tratarse de            retribuciones post-empleo, debiendo cargarse a una cuenta del subgrupo 64 en las retribuciones a                    largo plazo al personal.\r\n     a3) Por el importe de los ajustes que surjan por la actualización de valores, con cargo a cuentas del                       subgrupo 660.\r\n     a4) Por el importe imputado a la cuenta de pérdidas y ganancias de los costes por servicios pasados, con               cargo a la cuenta 6442.\r\n\r\nb) Se cargará:\r\n     b1) Por la disposición que se realice de la provisión, con abono, generalmente, a cuentas del subgrupo 57.\r\n     b2) Por el reconocimiento de ganancias actuariales, con abono a la cuenta 950, en caso de tratarse de                  retribuciones post-empleo, debiendo abonarse a una cuenta del subgrupo 64 en las retribuciones a                    largo plazo al personal.\r\n     b3) Por el rendimiento esperado de los activos afectos, con abono a la cuenta 767.\r\n     b4) Por el exceso de provisión, con abono a la cuenta 7950.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('141','PROVISION PARA IMPUESTOS','N',0,'PROVISION PARA IMPUESTOS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Importe estimado de deudas tributarias cuyo pago está indeterminado en cuanto a su importe exacto o a la fecha en que se producirá, dependiendo del cumplimiento o no de determinadas condiciones. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará por la estimación del devengo anual, con cargo a las cuentas de gasto correspondientes a los     distintos componentes que las integren. En particular: \r\n    a1) A cuentas del subgrupo 63 por la parte de la provisión correspondiente a la cuota del ejercicio. \r\n    a2) A la cuenta 669 por los intereses de demora correspondientes al ejercicio. \r\n    a3) A la cuenta 678, en su caso, por la sanción asociada. \r\n    a4) A la cuenta 113 por la  cuota y los intereses correspondientes a ejercicios anteriores.\r\n\r\nb) Se cargará: \r\n    b1) Cuando se aplique la provisión, con abono a cuentas del subgrupo 47. \r\n    b2) Por el exceso de provisión, con abono a la cuenta 7951. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('142','PROVISION PARA OTRAS RESPONSABILIDADES','N',0,'PROVISION PARA OTRAS RESPONSABILIDADES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Pasivos no financieros surgidos por obligaciones de cuantía indeterminada no incluidas en ninguna de las restantes cuentas de este subgrupo; entre otras, las procedentes de litigios en curso, indemnizaciones u obligaciones derivados de avales y otras garantías similares a cargo de la empresa. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará: \r\n    a1) Al nacimiento de la obligación que determina la indemnización o pago, o por cambios posteriores en su           importe que supongan un incremento de la provisión, con cargo,a las cuentas del grupo 6 que         correspondan.\r\n    a2) Por el importe de los ajustes que surjan por la actualización de valores, con cargo a cuentas del                    subgrupo 660.\r\n \r\nb) Se cargará: \r\n    b1) A la resolución firme del litigio, o cuando se conozca el importe definitivo de la indemnización o el pago,            con abono, generalmente, a cuentas del subgrupo 57. \r\n    b2) Por el exceso de provisión, con abono a la cuenta 7952. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('143','PROVISIONES POR DESMANTELAMIENTO, RETIRO O REHAB. DE INMV.','N',0,'PROVISIONES POR DESMANTELAMIENTO, RETIRO O REHAB. DE INMV.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Importe estimado de los costes de desmantelamiento o retiro del inmovilizado, así como la rehabilitación del lugar sobre el que se asienta. La empresa puede incurrir en estas obligaciones en el momento de adquirir el inmovilizado o para poder utilizar el mismo durante un determinado periodo de tiempo.\r\n\r\nCuando se incurra en esta obligación en el momento de adquirir el inmovilizado o surja como consecuencia de utilizar el inmovilizado con propósito distinto a la producción de existencias.\r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará: \r\n    a1) Al nacimiento de la obligación, o por cambios posteriores en su importe que supongan un incremento de           la provisión, con cargo, generalmente, a cuentas del subgrupo 21. \r\n    a2) Por el importe de los ajustes que surjan por la actualización de valores, con cargo a cuentas del                     subgrupo 660.\r\n\r\nb) Se cargará: \r\n     b1) Al cierre del ejercicio, por las disminuciones en el importe de la provisión originadas por una nueva                     estimación de su importe distinta a la actualización financiera, con abono, generalmente, a cuentas del            subgrupo 21. \r\n    b2) Cuando se aplique la provisión, con abono, generalmente, a cuentas del subgrupo 57. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('145','PROVISIONES PARA ACTUACIONES MEDIOAMBIENTALES','N',0,'PROVISIONES PARA ACTUACIONES MEDIOAMBIENTALES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Obligaciones legales, contractuales o implícitas de la empresa o compromisos adquiridos por la misma, de cuantía indeterminada, para prevenir o reparar daños sobre el medio ambiente, salvo las que tengan su origen en el desmantelamiento, retiro o rehabilitación del inmovilizado, que se contabilizarán según lo establecido en la cuenta 143. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará: \r\n    a1) Al nacimiento de la obligación o por cambios posteriores en su importe que supongan un incremento de           la provisión, con cargo a la cuenta 622 ó 623. \r\n    a2) Por el importe de los ajustes que surjan por la actualización de valores, con cargo a cuentas del                     subgrupo 660. \r\n\r\nb) Se cargará: \r\n    b1) Cuando se aplique la provisión, con abono, generalmente, a cuentas del subgrupo 57. \r\n    b2) Por el exceso de provisión, con abono a la cuenta 7955. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('146','PROVISION PARA REESTRUCTURACIONES','N',0,'PROVISION PARA REESTRUCTURACIONES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Importe estimado de los costes que surjan directamente de una reestructuración, siempre y cuando se cumplan las dos condiciones siguientes:\r\n- Estén necesariamente impuestos por la reestructuración.\r\n- No estén asociados con las actividades que continúan en la empresa.\r\n\r\nA estos efectos, se entiende por reestructuración un programa de actuación planificado y controlado por la empresa, que produzca un cambio significativo en:\r\n- El alcance de la actividad llevado a cabo por la empresa, o\r\n- La manera de llevar la gestión de su actividad.\r\n\r\nCon carácter general, su movimiento es el siguiente:\r\na) Se abonará:\r\n    a1) Al nacimiento de la obligación o por cambios posteriores en su importe que supongan un incremento de           la provisión, con cargo, generalmente, a cuentas de los subgrupos 62 y64.\r\n    a2) Por el importe de los ajustes que surjan por la actualización de valores, con cargo a cuentas del                      subgrupo 660.\r\n\r\nb) Se cargará:\r\n    b1) Cuando se aplique la provisión, con abono, generalmente, a cuentas del subgrupo 57.\r\n    b2) Por el exceso de la provisión, con abono a la cuenta 7956.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('147','PROV. POR TRANSACCIONES CON PAGOS BASADOS PATRIMONIO NETO','N',0,'PROV. POR TRANSACCIONES CON PAGOS BASADOS PATRIMONIO NETO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Importe estimado de la obligación asumida por la empresa como consecuencia de una transacción con pagos basados en instrumentos de patrimonio que se liquiden con un importe efectivo que esté basado en el valor de dichos instrumentos.\r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se abonará:\r\n    a1) Al nacimiento de la obligación o por cambios posteriores en su importe que supongan un incremento de            la provisión, con cargo, generalmente, a cuentas de los subgrupos 62 ó 64.\r\n    a2) Por el importe de los ajustes que surjan por la actualización de valores, con cargo a cuentas del                     subgrupo 660.\r\n\r\nb) Se cargará:\r\n    b1) Cuando se aplique la provisión, con abono, generalmente, a cuentas del subgrupo 57.\r\n    b2) Por el exceso de provisión, con abono a la cuenta 7957.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('15','DEUDAS A LARGO PLAZO CON CARACTERISTISCAS ESPECIALES','N',0,'DEUDAS A LARGO PLAZO CON CARACTERISTISCAS ESPECIALES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Acciones u otras participaciones en el capital de la empresa que, atendiendo a las características económicas de la emisión deban contabilizarse como pasivo. En este subgrupo se incluyen también las situaciones transitorias de financiación relacionas con estos instrumentos financieros. \r\n\r\nLa parte de las deudas a largo plazo con características especiales, que tenga vencimiento a corto deberá figurar en el pasivo corriente del balance, en el epígrafe \"Deudas con características especiales a corto plazo\"; a estos efectos se traspasará el importe que representen estas deudas a largo plazo con vencimiento a corto a la cuenta 502. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('150','ACCIONES O PARTICIPACIONES A L.PLAZO CONSIDERADA COMO PASIVO','N',0,'ACCIONES O PARTICIPACIONES A L.PLAZO CONSIDERADA COMO PASIVO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Capital escriturado en las sociedades que revistan forma mercantil que, atendiendo a las características de la emisión, deba contabilizarse como pasivo financiero. En particular, determinadas acciones rescatables y acciones o participaciones sin voto. \r\n\r\nFigurarán en el pasivo no corriente del balance en el epígrafe \"Deudas con caractetísticas especiales a largo plazo\". \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará por el capital inicial y las sucesivas ampliaciones, en el momento de su inscripción en el         Registro Mercantil, con cargo a la cuenta 199. \r\n\r\nb) Se cargará por la cancelación o reducciones del mismo y a la extinción de la sociedad, una vez transcurrido     el período de liquidación. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('153','DESEMBOLSOS NO EXIGIDOS POR ACC. O PART. CONT. COMO PASIVO','N',0,'DESEMBOLSOS NO EXIGIDOS POR ACC. O PART. CONT. COMO PASIVO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Capital social escriturado no exigido correspondiente a los instrumentos financieros cuya calificación contable sea la de pasivo financiero. \r\n\r\nFigurarán en el pasivo no corriente de balance con signo negativo, minorando el epígrafe \"Deudas con características especiales a largo plazo\". \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('1533','DESEMBOLSOS NO EXIGIDOS, EMPRESAS DEL GRUPO.','N',0,'DESEMBOLSOS NO EXIGIDOS, EMPRESAS DEL GRUPO.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'a) Se cargarán por el valor nominal no desembolsado de las acciones suscritas o participaciones asumidas,     con abono, generalmente, a las cuentas 190 ó 192. \r\n\r\nb) Se abonarán por los desembolsos exigidos, con cargo a la cuenta 558. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
