insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('1535','DESEMBOLSOS NO EXIGIDOS, OTRAS PARTES VINCULADAS','N',0,'DESEMBOLSOS NO EXIGIDOS, OTRAS PARTES VINCULADAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'a) Se cargarán por el valor nominal no desembolsado de las acciones suscritas o participaciones asumidas,     con abono, generalmente, a las cuentas 190 ó 192. \r\n\r\nb) Se abonarán por los desembolsos exigidos, con cargo a la cuenta 558. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
