insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('172','DEUDAS A L.PLAZO TRANSFORMABLES EN SUBV., DONACIONES Y LEGAD','N',0,'DEUDAS A L.PLAZO TRANSFORMABLES EN SUBV., DONACIONES Y LEGAD',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Cantidades concedidas por las Administraciones Públicas, tanto nacionales como internacionales empresas o particulares con carácter de subvención, donación o legado reintegrable, con vencimiento superior a un año. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará por las cantidades concedidas a la empresa con cargo, generalmente, a cuentas de los         subgrupos 47 ó 57. \r\n\r\nb) Se cargará: \r\n    b1) Por cualquier circunstancia que determine la reducción total o parcial de las mismas, con arreglo a los           términos de su concesión, con abono, generalmente, a la cuenta 4758. \r\n    b2) Si pierde su carácter de reintegrable, con abono de su saldo a las cuentas 940, 941 o 942 o a cuentas       del subgrupo 74.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('173','PROVEEDORES DE INMOVILIZADO A LARGO PLAZO','N',0,'PROVEEDORES DE INMOVILIZADO A LARGO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Deudas con suministradores de bienes definidos en el grupo 2, con vencimiento superior a un año. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará: \r\n    a1) Por la recepción a conformidad de los bienes suministrados, con cargo a cuentas del grupo 2. \r\n    a2) Por el gasto financiero devengado hasta el valor de reembolso de la deuda, con cargo, generalmente, a           la cuenta 662. \r\n\r\nb) Se cargará: \r\n     b1) Por la aceptación de efectos a pagar, con abono a la cuenta 175. \r\n     b2) Por la cancelación anticipada, total o parcial, de las deudas, con abono, generalmente, a cuentas del            subgrupo 57\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('174','ACREEDORES POR ARRENDAMIENTO FINANCIERO A LARGO PLAZO','N',0,'ACREEDORES POR ARRENDAMIENTO FINANCIERO A LARGO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Deudas con vencimiento superior a un año con otras entidades de calidad de cedentes del uso de bienes, en acuerdos que deban calificarse como arrendamientos financieros en los términos recogidos en las normas de registro y valoración.\r\n\r\na) Se abonará:\r\n\r\n   a1) Por la recepción a conformidad del derecho de uso sobre bienes suministrados, con cargo a cuentas del          subgrupo 2.\r\n   a2) Por el gasto financiero devengado hasta alcanzar el valor de reembolso de la deuda, cor cargo,          generalmente, a la cuenta 662.\r\n\r\nb) Se cargará por la cencelación anticipada, total o parcial, de las deudas, con abono, generalmente, a     cuentas del subgrupo 57.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('175','EFECTOS A PAGAR A LARGO PLAZO','N',0,'EFECTOS A PAGAR A LARGO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Deudas contraídas por préstamos recibidos y otros débitos con vencimiento superior a un año, instrumentadas mediante efectos de giro, incluidas aquellas que tengan su origen en suministros de bienes de inmovilizado.\r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se abonará:\r\n    a1) Cuando la empresa acepte los efectos, con cargo, generalmente, a cuentas de este subgrupo.\r\n    a2) Por el gasto financiero devengado hasta alcanzar el valor de reembolso de la deuda, con cargo,           generalmente, a la cuenta 662.\r\n\r\nb) Se cargará por el pago anticipado de los efectos, con abono, generalmente, a cuentas del subgrupo 57.\r\n    \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('176','PASIVOS POR DERIVADOS FINANCIEROS A LARGO PLAZO.','N',0,'PASIVOS POR DERIVADOS FINANCIEROS A LARGO PLAZO.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Importe correspondiente a las operaciones con derivados financieros con valoración desfavorable para la empresa cuyo plazo de liquidación sea superior a un año. También se incluyen los derivados implícitos de instrumentos financieros híbridos adquiridos, emitidos o asumidos, que cumplan los criterios para su inclusión en esta cuenta, creándose en caso necesario cuentas de cuatro o más cifras que identifiquen que se trata de un derivado implícito.\r\n\r\nEn particular, se recogeran en esta cuenta las primas cobradas en operaciones con opciones, así como, con carácter general, las variaciones en el valor razonable de los pasivos por derivados financieros con los que opera la empresa: opciones, futuros, permutas financieras, compraventa a plazo de moneda extranjera, etc.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('1765','PASIVOS POR DERIVADOS FINANCIEROS A L. PLAZO, CARTERA NEGOC.','N',0,'PASIVOS POR DERIVADOS FINANCIEROS A L. PLAZO, CARTERA NEGOC.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se abonará:\r\n    a1) Por el importe recibido en el momento de la contratación, con cargo, generalmente, a cuentas del           subgrupo 57.\r\n    a2) Por las pérdidas que se generen en el ejercicio, con cargo a la cuenta 6630.\r\n\r\nb) Se cargará:\r\n    b1) Por las ganancias que se generen en el ejercicio hasta el límite del importe por el que figurará registrado          el derivado en el pasivo en el ejercicio anterior, con abono a la cuenta 7630.\r\n    b2) Por las cantidades satisfechas en el momento de la liquidación, con abono, generalmente, a las cuentas           del subgrupo 57.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('1768','PASIVOS POR DERIVADOS FINANCIEROS L. PLAZO, INST. COBERTURA','N',0,'PASIVOS POR DERIVADOS FINANCIEROS L. PLAZO, INST. COBERTURA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se abonará por el importe recibido en el momento de la contratación, con cargo, generalmente, a cuentas   del subgrupo 57.\r\n\r\nb) Cuando el derivado se utilice como instrumento de cobertura, es una cobertura de valor razonable:\r\n    b1) Se cargará:\r\n          i) Por las ganancias que se generen en el ejercicio al aplicar las regla que rigen la contabilidad de              coberturas, hasta el límite del importe por el que figurará registrado el derivado en el pasivo en el              ejercicio anterior, con abono a una cuenta que se imputará a la cuenta de pérdidas y ganancias en la              misma partida en la que se incluyan las pérdidas que se generen en las partidas cubiertas al valorar el              riesgo cubierto por su valor razonable.\r\n          ii) En el momento en que se adquiera el activo o se asuma el pasivo cubiertos, con abono a las cuentas              en que se contabilicen dichos elementos patrimoniales.\r\n\r\n    b2) Se abonará por las pérdidas que se generen en el ejercicio al aplicar las reglas que rigen la contabilidad           de coberturas, con cargo a una cuenta que se imputará a la cuenta de pérdidas y ganancias en la                     misma partida en la que se incluyan las ganancias que se generen en las partidas cubiertas al valorar el           riesgo cubierto por su valor razonable.\r\n\r\nc) Cuando el rerivado se utilice como instrumento de cobertura, en otras operaciones de cobertura, por la parte eficaz, se cargará o abonará, por la ganancia o pérdida que se generen en el ejercicio al aplicar las reglas que rigen la contabilidad de coberturas, con abono o cargo, a las cuentas del subgrupo 91 y 81, respectivamente, y por la parte ineficaz, a las cuentas 7633 y 6633.\r\n\r\nd) Se cargará por las cantidades satisfechas en el momento de liquidación, con abono, generalmente, a cuentas del subgrupo 57.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('177','OBLIGACIONES Y BONOS','N',0,'OBLIGACIONES Y BONOS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Obligaciones y bonos en circulación no convertibles en acciones.\r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se abonará:\r\n    a1) En el momento de la emisión, por el importe recibido, minorado en los gastos de la transacción, con                   cargo a cuentas del subgrupo 57.\r\n    a2) Por el gasto financiero devengado hasta el valor de reembolso de la deuda, con cargo, generalmente, a           la cuenta 661.\r\n\r\nb) Se cargará por el importe a reembolsar de los valores a la amortización anticipada de los mismos, con         abono, generalmente, a la cuenta 509 y, en su caso, a la cuenta 775.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('178','OBLIGACIONES Y BONOS CONVERTIBLES','N',0,'OBLIGACIONES Y BONOS CONVERTIBLES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Componente de pasivo financiero de las obligaciones y bonos convertibles en acciones, que se califican como instrumentos financieros compuestos.\r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se abonará:\r\n    a1) En el momento de la emisión, por el importe recibido, minorado en los gastos de la transacción, con                   cargo a cuentas del subgrupo 57.\r\n    a2) Por el gasto financiero devengado hasta el valor de reembolso de la deuda, con cargo, generalmente, a           la cuenta 661.\r\n\r\nb) Se cargará por el importe a reembolsar de los valores a la amortización anticipada de los mismos, con         abono, generalmente, a la cuenta 509 y, en su caso, a la cuenta 775.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('179','DEUDAS REPRESENTADAS EN OTROS VALORES NEGOCIABLES','N',0,'DEUDAS REPRESENTADAS EN OTROS VALORES NEGOCIABLES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Otros pasivos financieros representados en valores negociables, ofrecidios al ahorro público, distinto de los anteriores.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('18','PASIVOS POR FIANZAS Y GARANTIAS A LARGO PLAZO','N',0,'PASIVOS POR FIANZAS Y GARANTIAS A LARGO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Las cuentas de este subgrupo figurarán en el pasivo no corriente del balance. \r\n\r\nLa parte de fianzas, depósitos recibidos y garantías financieras concedidas a largo plazo que tenga vencimiento a corto deberá figurar en el pasivo corriente del balance, en el epígrafe \"Deudas a corto plazo\"; a estos efectos se traspasará el importe que representen las fianzas, depósitos recibidos y garantías financieras concedidas a largo plazo con vencimiento a corto a las cuentas correspondientes del subgrupo 56. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('180','FIANZAS RECIBIDAS A LARGO PLAZO','N',0,'FIANZAS RECIBIDAS A LARGO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Efectivo recibido como garantía del cumplimiento de una obligación, a plazo superior a un año. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará \r\n    a1) a la constitución, por el efectivo recibido, con cargo a cuentas del subgrupo 57. \r\n    a2) Por el gasto financiero devengado hasta alcanzar el valor de reembolso de la fianza, con cargo,           generalmente, a la cuenta 662.\r\n\r\nb) Se cargará: \r\n    b1) A la cancelación anticipada, con abono a cuentas del subgrupo 57. \r\n    b2) Por incumplimiento de la obligación afianzada que determine pérdidas en la fianza, con abono a la                    cuenta 759. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('181','ANTICIPOS RECIBIDOS VENTAS O PRESTACIONES SERVICIOS L. PLAZO','N',0,'ANTICIPOS RECIBIDOS VENTAS O PRESTACIONES SERVICIOS L. PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Importe recibido \" a cuenta\" de futuras ventas o prestaciones de servicios.\r\n\r\nCon caracter general, su movimiento es el siguiente:\r\n\r\na) Se abonará:\r\n    a1) Por el importe recibido con cargo a cuentas del subgrupo 57.\r\n    a2) Por el importe de los ajustes que surjan por la actualización de su valor, con cargo, generalmente, a la           cuenta 662.\r\n\r\nb) Se cargará cuando se devengue el ingreso, con abono a cuentas del subgrupo 70.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('185','DEPOSITOS RECIBIDOS A LARGO PLAZO','N',0,'DEPOSITOS RECIBIDOS A LARGO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Efectivo recibido en concepto de depósito irregular, a plazo superior a un año. \r\n\r\nCon carácter general, su movimiento es el siguiente: \r\n\r\na) Se abonará:\r\n    a1) A la constitución, por el valor razonable del pasivo financiero, con cargo a cuentas del subgrupo 57. \r\n    a2) Por el gasto financiero devengado hasta alcanzar el valor de reembolso del depósito, con cargo,           generalmente, a la cuenta 662.\r\n\r\nb) Se cargará a la cancelación anticipada, con abono a cuentas del subgrupo 57\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('189','GARANTIAS FINANCIERAS A LARGO PLAZO','N',0,'GARANTIAS FINANCIERAS A LARGO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Garantías financieras concedidas por la empresa a plazo superior a un año. En particular, avales otorgados, siempre y cuando no proceda su registro en el subgrupo 14. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará: \r\n    a1) A la constitución, por el valor razonable del pasivo financiero, con cargo a cuentas del subgrupo 57. \r\n    a2) Por el gasto financiero devengado, con cargo, generalmente, a la cuenta 662.\r\n    a2) Por el aumento de la obligación, con cargo a la cuenta 669. \r\n\r\nb) Se cargará: \r\n    b1) Por la disminución de la obligación y por los ingresos devengados, con abono a la cuenta 769. \r\n    b2) A la cancelación anticipada, con abono a cuentas del subgrupo 57. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('19','SITUACIONES TRANSITORIAS DE FINANCIACION','N',0,'SITUACIONES TRANSITORIAS DE FINANCIACION',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('190','ACCIONES O PARTICIPACIONES EMITIDAS','N',0,'ACCIONES O PARTICIPACIONES EMITIDAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Capital social y, en su caso, prima de emisión o asunción de acciones o participaciones emitidas y pendientes de suscripción. \r\n\r\nFigurará en el pasivo corriente del balance, con signo negativo, dentro del epígrafe \"Deudas a corto plazo\". \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará por el valor nominal y, en su caso, la prima de emisión o asunción de las acciones o     participaciones emitidas y pendientes de suscripción, con abono a la cuenta 194. \r\n\r\nb) Se abonará a medida que se suscriban o asuman las acciones o participaciones: \r\n    b1) En los supuestos de fundación simultánea, con cargo, generalmente, a cuentas del subgrupo 57, o a           las cuentas 1034 y 1044.\r\n    b2) En los supuestos de fundación sucesiva, con cargo a la cuenta 192. \r\n    b3) En los supuestos en que no se suscriban acciones o participaciones emitidas con cargo a la cuenta           194. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('192','SUSCRIPTORES DE ACCIONES','N',0,'SUSCRIPTORES DE ACCIONES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Derecho de la sociedad a exigir de los suscriptores el importe de las acciones suscritas. \r\n\r\nFigurará en el pasivo corriente del balance, con signo negativo, dentro del epígrafe \"Deudas a corto plazo\". \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará por el valor nominal y, en su caso, la prima de emisión de las acciones suscritas, con abono a la     cuenta 190. \r\n\r\nb) Se abonará cuando se dé conformidad a la suscripción de las acciones, con cargo, generalmente, a     cuentas del subgrupo 57, o a las cuentas 1034 y 1044\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('194','CAPITAL EMITIDO PENDIENTE DE INSCRIPCION','N',0,'CAPITAL EMITIDO PENDIENTE DE INSCRIPCION',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Capital social y, en su caso, prima de emisión o asunción de acciones o participaciones con naturaleza de patrimonio neto emitidas y pendientes de inscripción en el Registro Mercantil. \r\n\r\nFigurará en el pasivo corriente del balance si en la fecha de formulación de las cuentas anuales no se hubiera producido la inscripción en el Registro Mercantil.\r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará por el valor nominal y, en su caso, la prima de emisión o asunción de las acciones o     participaciones emitidas y pendientes de inscripción, con cargo, a la cuenta 190. \r\n\r\nb) Se cargará; \r\n    b1) En el momento de la inscripción del capital en el Registro Mercantil, con abono, generalmente, a las           cuentas 100 y 110.\r\n    b2) En los supuestos en que no se suscriban acciones o participaciones emitidas, con abono a la cuenta           190. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('195','ACCIONES O PARTIC. EMITIDAS CONSIDERADAS COMO PASIV. FINANC.','N',0,'ACCIONES O PARTIC. EMITIDAS CONSIDERADAS COMO PASIV. FINANC.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Capital social y, eun su caso, prima de emisión o asunción de acciones o participaciones emitidas consideradas como pasivo financiero y pendientes de suscripción.\r\n\r\nFigurará en el pasivo corriente del balance, con signo negativo, dentro del epígrafe \"Deudas a corto plazo con características especiales\".\r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se cargará por el valor nominal y, en su caso, la prima de emisión o asunción de las acciones o   participaciones emitidas y pendientes de suscripción, con abono a la cuenta 199.\r\n\r\nb) Se abonará a medida que se suscriban o asuman las acciones o participaciones:\r\n    b1) En los supuestos de fundación simultánea, con cargo, generalmente, a cuentas del subgrupo 57 o a las           cuentas 153 y 154.\r\n    b2) En los supuestos de fundación sucesiva, con cargo a la cuenta 197.\r\n    b3) En los supuestos en que no se suscriban acciones o participaciones emitidas, cargo a la cuenta 199','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('197','SUSCRIPTORES DE ACCIONES CONSIDERADAS COMO PASIV.FINANCIEROS','N',0,'SUSCRIPTORES DE ACCIONES CONSIDERADAS COMO PASIV.FINANCIEROS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Derecho de la sociedad a exigir a los suscriptores el importe de las acciones suscritas consideradas como pasivo financiero.\r\n\r\nFigurará en el pasivo corriente del balance, con signo negativo, dentro del epígrafe \"Deudas a corto plazo con características especiales\".\r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se cargará por el valor nominal y, en su caso, la prima de emisión de las acciones suscritas, con abono a la cuenta 195.\r\n\r\nb) Se abonará cuando se dé conformidad a las suscripción de las acciones, con cargo, generalmente, a cuentas del subgrupo 57, o a las cuentas 153 y 154.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('199','ACCIONES O PARTICIP. EMITIDAS COMO PASIVOS FINANC. PDTES.INS','N',0,'ACCIONES O PARTICIP. EMITIDAS COMO PASIVOS FINANC. PDTES.INS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Capital social y, en su caso, prima de emisión o asunción de acciones o participaciones consideradas como pasivo financiero emitidas y pendientes de inscripción en el Registro Mercantil\r\n\r\nFigurará en el pasivo corriente del balance, dentro del epígrafe \"Deudas a corto plazo con características especiales\".\r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se abonará por el valor nominal y, en su caso, la prima de emisión o asunción de las acciones o participaciones emitidas y pendientes de inscripción, con cargo, a la cuenta 195.\r\n\r\nb) Se cargará:\r\n    b1) En el momento de la inscripción del capital en el Registro Mercantil, con abono, a las cuentas 150 y           502.\r\n    b2) En los supuestos en que no se suscriban acciones o participaciones emitidas, con abono a la cuenta           195.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('2','INMOVILIZADO','N',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('20','INMOVILIZACIONES INTANGIBLES','N',0,'INMOVILIZACIONES INTANGIBLES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Las inmovilizaciones intangibles son activos no monetarios sin apariencia física susceptibles de valoración económica, así como los anticipos a cuenta entregados a proveedores de inmovilizado.\r\n\r\nAdemás de los elementos intangibles mencionados, existen otros elementos de esta naturaleza que serán reconocidos como tales en balance, siempre y cuando cumplan las condiciones señaladas en el Marco Conceptual de la Contabilidad, así como los requisitos especificados en las normas de registro y valoración. Entre otros, los siguientes: derechos comerciales, propiedad intelectual o licencias, Para su registro se abrirá una cuenta en este subgrupo cuyo movimiento será similar al descrito a continuación para las restantes cuentas del inmovilizado intangible. \r\n\r\nLas cuentas de este subgrupo figurarán en el activo no corriente del balance\r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('200','INVESTIGACION','N',0,'INVESTIGACION',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Es la indagación original y planificada que persigue descubrir nuevos conocimientos y superior comprensión en los terrenos científico o técnico. Contiene los gastos de investigación activados por la empresa, de acuerdo con lo establecido en las normas de registroy valoración de este texto.\r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se cargará por el importe de los gastos que deban figurar en esta cuenta, con abono a la cuenta 730.\r\n\r\nb) Se abonará por la baja del activo, en su caso, con cargo a la cuenta 670.\r\n\r\nCuando se trate de investigación por encargo a otras empresas o a Universidades u otras Instituciones dedicadas a la investigación científica o tecnológica, el movimiento de la cuenta 200, es también el que se ha indicado\r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('201','DESARROLLO','N',0,'DESARROLLO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Es la aplicacion concreta de los logros obtenidos de la investigación o de cualquier otro tipo de conocimiento científico, a un pla o diseño en particular para la producción de materiales, productos, métodos, procesos o sistemas nuevos, o sustancialmente mejorados, hasta que se inicia la producción comercial.\r\n\r\nContiene los gastos de desarrollo activados por la empresa de acuerdo con lo establecido en las normas de registro y valoración de este texto.\r\n\r\nSu movimiento es el siguiente:\r\n\r\nA) Se cargará por el importe de los gastos que deban figurar en esta cuento, con abono a la cuenta 730.\r\n\r\nb) Se abonará:\r\n    b1) Por la baja del activo, en su caso, con cargo a la cuenta 670.\r\n    b2) Por los resultados positivos y, en su caso, incriptos en el correspondiente Registro Público, con cargo a           la cuenta 203 0 206, según proceda.\r\n\r\n\r\nCuando se trate de investigación por encargo a otras empresas o a Universidades u otras Instituciones dedicadas a la investigación científica o tecnológica, el movimiento de la cuenta 201, es también el que se ha indicado',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('202','CONCESIONES ADMINISTRATIVAS','N',0,'CONCESIONES ADMINISTRATIVAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Gastos efectuados para la obtención de derechos de investigación o de explotación otorgados por el Estado u otras Administraciones Públicas, o el precio de adquisición de aquellas concesiones susceptibles de transmisión. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará por los gastos originados para obtener la concesión, o por el precio de adquisición, con abono,     generalmente, a cuentas del subgrupo 57. \r\n\r\nb) Se abonará por las enajenaciones y en general por su baja del activo, con cargo, generalmente, a cuentas     del subgrupo 57 y en caso de pérdidas a la cuenta 670. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('203','PROPIEDAD INDUSTRIAL','N',0,'PROPIEDAD INDUSTRIAL',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Importe satisfecho por la propiedad o por el derecho al uso o a la concesión del uso de las distintas manifestaciones de la propiedad industrial, en los casos en que, por las estipulaciones del contrato, deban inventariarse por la empresa adquirente. Este concepto incluye, entre otras, las patentes de invención, los certificados de protección de modelos de utilidad pública y las patentes de introducción. \r\n\r\nEsta cuenta comprenderá también los gastos realizados en desarrollo cuando los resultados de los respectivos proyectos emprendidos por la empresa fuesen positivos y, cumpliendo los necesarios requisitos legales, se inscriban en el correspondiente Registro. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará: \r\n    a1) Por la adquisición a otras empresas, con abono, generalmente, a cuentas del subgrupo 57. \r\n    a2) Por ser positivos e inscritos en el correspondiente Registro Público, los resultados de desarrollo, con                  abono a la cuenta 201.\r\n    a3) Por los desembolsos exigidos para la inscripción en el correspondiente Registro, con abono,                     generalmente, a cuentas del subgrupo 57. \r\n \r\nb) Se abonará por las enajenaciones y en general por la baja del activo, con cargo, generalmente, a cuentas     del subgrupo 57 y en caso de pérdidas a la cuenta 670. \r\n\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('204','FONDO DE COMERCIO','N',0,'FONDO DE COMERCIO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Es el exceso, en la fecha de adquisición, del coste de la combinación de negocios sobre el correspondiente valor de los activos identificables adquiridos menos el de los pasivos asumidos.\r\n\r\nEn consecuencia, el fondo de comercio sólo se reconocerá cuando haya sido adquirido a título oneroso, y corresponda a los beneficios económicos futuros procedentes de activos que no han podido ser identificados individualmente y reconocidos por separado.\r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se cargará por el importe resultante de la aplicación del método de la adquisición, con abono, generalmente, a cuentas del subgrupo 57, o a la cuenta 553.\r\n\r\nb) Se abonará:\r\n    b1) Por el importe del deterioro estimado, con cargo a la cuenta 690.\r\n    b2) Por las enajenacione sy en general por la baja del activo, co cargo, generalmente, a cuentas del           subgrupo 57 y en caso de pérdias a la cuenta 670.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('205','DERECHOS DE TRASPASO','N',0,'DERECHOS DE TRASPASO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Importe satisfecho por los derechos de arrendamiento de locales, en los que el adquirente y nuevo arrendatario, se subroga en los derechos y obligaciones del transmitente y antiguo arrendatario derivados de un contrato anterior. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará por el importe de su adquisición, con abono, generalmente, a cuentas del subgrupo 57. \r\n\r\nb) Se abonará por las enajenaciones y en general por su baja del activo, con cargo, generalmente, a cuentas     del subgrupo 57 y en caso de pérdidas a la cuenta 670. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('206','APLICACIONES INFORMATICAS','N',0,'APLICACIONES INFORMATICAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Importe satisfecho por la propiedad o por el derecho al uso de programas informáticos tanto adquiridos a terceros como elaborados por la propia empresa. También incluye los gastos de desarrollo de las páginas web, siempre que su utilización esté prevista durante varios ejercicios.\r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se cargará:\r\n    a1) Por la adquisición a otras empresas, con abono, generalmente, a cuentas del subgrupo 57.\r\n    a2) Por la elaboración propia, con abono a la cuenta 730 y, en su caso, a la cuenta 200.\r\n\r\nb) Se abonará por las enajenaciones y en general por su baja del activo, con cargo, generalmente, a cuentas     del subgrupo 57 y en caso de pérdidas a la cuenta 670.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
