insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('209','ANTICIPOS PARA INMOVILIZACIONES INTANGIBLES','N',0,'ANTICIPOS PARA INMOVILIZACIONES INTANGIBLES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Entregas a proveedores y otros suministradores de elementos de inmovilizado intangible, normalmente en efectivo, en concepto de \"a cuenta\" de suministros o de trabajos futuros. \r\n\r\nFigurarán en el balance en la partida \"Otro inmovilizado intangible\". \r\n\r\nCon carácter general, su movimiento es el siguiente: \r\n\r\na) Se cargará por las entregas de efectivo a los proveedores, con abono a cuentas del subgrupo 57. \r\n\r\nb) Se abonará por las correspondientes entregas a conformidad, con cargo, generalmente, a cuentas de este     subgrupo. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
