insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('239','ANTICIPOS PARA INMOVILIZACIONES MATERIALES','N',0,'ANTICIPOS PARA INMOVILIZACIONES MATERIALES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Entregas a proveedores y otros suministradores de elementos de inmovilizado material, normalmente en efectivo, en concepto de \"a cuenta\" de suministros o de trabajos futuros. \r\n\r\nCon carácter general, su movimiento es el siguiente: \r\n\r\na) Se cargará por las entregas de efectivo a los proveedores, con abono, generalmente, a cuentas del     subgrupo 57. \r\n\r\nb) Se abonará por las correspondientes entregas a conformidad, con cargo, generalmente, a las cuentas de     este subgrupo y del subgrupo 21. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('24','INVERSIONES FINANCIERAS EN PARTES VINCULADAS','N',0,'INVERSIONES FINANCIERAS EN PARTES VINCULADAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Inversiones financieras a largo plazo en empresas del grupo, multigrupo, asociadas y otras partes vinculadas, cualquiera que sea su forma de instrumentación, incluidos los intereses devengados, con vencimiento superior a un año o sin vencimiento (como los instrumentos de patrimonio), cuando la empresa no tenga la inteción de venderlos en el corto plazo. También se incluirán en este subgrupo las fianzas y depósitos a largo plazo constituidas con estas personas o entidades. Estas inversiones se recogerán en las cuentas de tres o más cifras que se desarrollen.\r\n\r\nEn caso de que los valores representativos de deuda o los créditos devenguen intereses explícitos con vencimiento superior a un año, se crearán las cuentas necesarias para identificarlos, debiendo figurar en el balance en la misma partida que se incluya el activo que los genera.\r\n\r\nLa parte de las inversiones a largo plazo, con personas o entidades vinculadas, que tenga vencimiento a corto deberá figurar en el activo corriente del balance, en el epígrafe \"Inversiones en empresas del grupo y asociadas a corto plazo\"; a estos efectos se traspasará el importe que represente la inversión a largo plazo con vencimiento a corto plazo, incluidos en su caso los intereses devengados, a las cuentas correspondientes del subgrupo 53. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('240','PARTICIPACIONES A LARGO PLAZO EN PARTES VINCULADAS','N',0,'PARTICIPACIONES A LARGO PLAZO EN PARTES VINCULADAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Inversiones a largo plazo en derechos sobre el patrimonio neto -con o sin cotización en un mercado regulado- de partes vinculadas, generalmente, acciones emitidas por una sociedad anónima o participaciones en sociedades de responsabilidad limitada. \r\n\r\nFigurará en el activo no corriente del balance\r\n\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('2403','PARTICIPACIONES A LARGO PLAZO EN EMPRESAS DEL GRUPO','N',0,'PARTICIPACIONES A LARGO PLAZO EN EMPRESAS DEL GRUPO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'El movimiento es el siguiente: \r\n\r\na) Se cargarán:\r\n    a1) A la suscripción o compra, con abono, generalmente, a cuentas del subgrupo 57 y, en su caso,     a la           cuenta 249. \r\n    a2) En su caso, en el momento en que el importe recuperable sea superior al valor contable de las           inversiones, hasta el limite de los ajustes valorativos negativos previos imputados directamente a           patrimonio neto, con abono a las cuentas 991 ó 992.\r\n\r\nb) Se abonarán:\r\n    b1) En su caso, por el importe del deterioro estimado, hasta el límite de los ajustes valorativos positivos           previos imputados directamente a patrimonio neto, con cargo a las cuentas 891 u 892.    \r\n    b2) Por las enajenaciones y en general por su baja del activo, con cargo, generalmente, a cuentas del                   subgrupo 57, si existen desembolsos pendientes a la cuenta 248 y en caso de pérdidas a la cuenta 673. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('2404','PARTICIPACIONES A LARGO PLAZO EN EMPRESAS ASOCIADAS','N',0,'PARTICIPACIONES A LARGO PLAZO EN EMPRESAS ASOCIADAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'El movimiento es el siguiente: \r\n\r\na) Se cargarán:\r\n    a1) A la suscripción o compra, con abono, generalmente, a cuentas del subgrupo 57 y, en su caso,     a la           cuenta 249. \r\n    a2) En su caso, en el momento en que el importe recuperable sea superior al valor contable de las           inversiones, hasta el limite de los ajustes valorativos negativos previos imputados directamente a           patrimonio neto, con abono a las cuentas 991 ó 992.\r\n\r\nb) Se abonarán:\r\n    b1) En su caso, por el importe del deterioro estimado, hasta el límite de los ajustes valorativos positivos           previos imputados directamente a patrimonio neto, con cargo a las cuentas 891 u 892.    \r\n    b2) Por las enajenaciones y en general por su baja del activo, con cargo, generalmente, a cuentas del                   subgrupo 57, si existen desembolsos pendientes a la cuenta 248 y en caso de pérdidas a la cuenta 673. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('2405','PARTICIPACIONES A LARGO PLAZO EN OTRAS PARTES VINCULADAS','N',0,'PARTICIPACIONES A LARGO PLAZO EN OTRAS PARTES VINCULADAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'El movimiento es el siguiente: \r\n\r\na) Se cargarán:\r\n    a1) A la suscripción o compra, con abono, generalmente, a cuentas del subgrupo 57 y, en su caso,     a la           cuenta 249. \r\n   \r\nb) Se abonarán:\r\n    b1) por el importe del deterioro estimado con cargo a las cuenta 696.   \r\n    b2) Por las enajenaciones y en general por su baja del activo, con cargo, generalmente, a cuentas del                   subgrupo 57, si existen desembolsos pendientes a la cuenta 249 o en su caso, a la cuenta 539 y en          caso de pérdidas a la cuenta 673. \r\n\r\nc) Si las participaciones se clasifican en la categoría de \"Activos financieros disponibles pra la venta\", se cargará o abonará, por las variaciones en su valor razonable, con abono o cargo, respectivamente, a las cuentas 900 y 800.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('241','VALORES REPRESENTATIVOS  DEUDA A L. PLAZO A PARTES VINCULA','N',0,'VALORES REPRESENTATIVOS  DEUDA A L. PLAZO A PARTES VINCULA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Inversiones a largo plazo en obligaciones, bonos u otros valores representativos de deuda, incluidos aquéllos que fijan su rendimiento en función de índices o sistemas análogos, emitidos por partes vinculadas, con vencimiento superior a un año. \r\n\r\nFigurará en el activo no corriente del balance. \r\n\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('2413','VALORES REPRESENTATIVOS DEUDA LARGO PLAZO, EMP. GRUPO','N',0,'VALORES REPRESENTATIVOS DEUDA LARGO PLAZO, EMP. GRUPO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'El movimiento es el siguiente: \r\n\r\na) Se cargarán:\r\n    a1)  A la suscripción o compra, por el precio de adquisición, excluidos los intereses explícitos devengados y           no vencidos, con abono, a cuentas del subgrupo 57. \r\n    a2) Por el ingreso financiero devengado hasta alcanzar el valor de reembolso del valor, con abono,           generalmente, a la cuenta 761.\r\n\r\nb) Se abonará por las enajenaciones, amortizaciones anticipadas o baja del activo de los valores, con cargo,     a cuentas del subgrupo 57 y en caso de pérdidas a la cuenta 666. \r\n\r\nc) Si los valores se clasifican en la categoría de \"Activos financieros disponibles para la venta\" se cargarán o abonarán, por las variaciones en su valor razonable, con abono o cargo, respectivamente, a las cuentas 900 y 800, salvo en la parte correspondiente a difrencias de cambio que se registrará con abono o cargo a las cuentas 768 y 668. También se cargarán cuando se produzca el deterioro del valor por el saldo negativo acumulado en el patrimonio neto, con abono a la cuenta 902.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
