insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('242','CREDITOS A LARGO PLAZO A PARTES VINCULADAS','N',0,'CREDITOS A LARGO PLAZO A PARTES VINCULADAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Inversiones a largo plazo en préstamos y otros créditos no comerciales, incluidos los derivados de enajenaciones de inmovilizado, los originados por operaciones de arrendamiento financiero y las imposiciones a largo plazo, estén o no formalizados mediante efectos de giro, concedidos a partes vinculadas, con vencimiento superior a un año. En el caso de crédito a administradores, deberán figurar en cuentas de cinco cifras. \r\n\r\nFigurará en el activo no corriente del balance. \r\n\r\nEl movimiento de las cuentas de cuatro cifras es el siguiente: \r\n\r\na) Se cargarán:\r\n    a1) A la formalización del crédito, por el importe de éste, con abono, generalmente, a cuentas del            subgrupo 57. \r\n    a2) Por el ingreso financiero devengado hasta alcanzar el valor de reembolso del crédito, con abono,           generalmente, a la cuenta 762.\r\n\r\nb) Se abonarán por el reintegro anticipado, total o parcial o baja del activo, con cargo, generalmente, a     cuentas del subgrupo 57 y en caso de pérdidas a la cuenta 667\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
