insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('25','OTRAS INVERSIONES FINANCIERAS A LARGO PLAZO','N',0,'OTRAS INVERSIONES FINANCIERAS A LARGO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Inversiones financieras a largo plazo no relacionadas con partes vinculadas, cualquiera que sea su forma de instrumentación, incluidos los intereses devengados, con vencimiento superior a un año o sin vencimiento (como los instrumentos de patrimonio), cuando la empresa no tenga intencidón de venderlos en el corto plazo. \r\n\r\nEn caso de que  los valores representativos de deuda o los créditos devenguen intereses explícitos con vencimiento superior a un año, se crearán las cuentas necesarias para identificarlos, debiendo figurar en el balance en la misma partida en la que se incluya el activo que los genera.\r\n\r\nLa parte de las inversiones a largo plazo que tenga vencimiento a corto deberá figurar en el activo corriente del balance, en el epígrafe \"Inversiones financieras a corto plazo\"; a estos efectos se traspasará el importe que represente la inversión a largo plazo con vencimiento a corto, incluidos en su caso los intereses devengados, a las cuentas correspondientes del subgrupo 54. \r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('250','INVERSIONES FINANCIERAS A LARGO PLAZO EN INSTRUMENT. PATRIMO','N',0,'INVERSIONES FINANCIERAS A LARGO PLAZO EN INSTRUMENT. PATRIMO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Inversiones a largo plazo en derechos sobre el patrimonio neto -acciones con o sin cotización en un mercado regulado u otros valores, tales como, participaciones en instituciones de inversión colectiva, o participaciones en sociedades de responsabilidad limitada - de entidades que no tengan la consideración de partes vinculadas. \r\n\r\nFigurará en el activo no corriente del balance. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará a la suscripción o compra, con abono, generalmente, a cuentas del subgrupo 57 y, en su caso,     a la cuenta 259. \r\n\r\nb) Se abonará:\r\n    b1) Por el importe del deterioro estimado, con cargo a la cuenta 696.\r\n    b2) Por las enajenaciones y en general por su baja del activo, con cargo, generalmente, a cuentas del           subgrupo 57, si existen desembolsos pendientes a la cuenta 259 y en caso de pérdidas a la cuenta            666. \r\n\r\nc) Si la inversión se clasifica en la categoría de \"Activos financieros disponibles para la venta\" , se cargará o abonará, por las variaciones en su valor razonable, con abono o cargo, respectivamente, a las cuentas 900 y 800. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
