insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('265','DEPOSITOS CONSTITUIDOS A LARGO PLAZO','N',0,'DEPOSITOS CONSTITUIDOS A LARGO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Efectivo entregado en concepto de depósito irregular a plazo superior a un año. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará:\r\n   a1) A la constitución, por el efectivo entregado, con abono a cuentas del subgrupo 57. \r\n   a2) Por el ingreso financiero devengado hasta alcanzar el valor de reembolso de los depósitos con abono,          generalmente, a la cuenta 762.\r\n\r\nb) Se abonará a la cancelación anticipada, con cargo a cuentas del subgrupo 57.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
