insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('29','DETERIORO DEL VALOR DEL INMOVILIZADO','N',0,'DETERIORO DEL VALOR DEL INMOVILIZADO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Expresión contable de las correcciones de valor motivadas por pérdidas debidas a deterioros de valor de los elementos del activo no corriente. \r\n\r\nLa estimación de tales pérdidas deberá realizarse de forma sistemática en el tiempo. En el supuesto de posteriores recuperaciones de valor, en los términos establecidos en las correspondientes normas de registro y valoración, las correcciones de valor por deterioro reconocidas deberán reducirse hasta su total recuperación, cuando así proceda de acuerdo con lo dispuesto en dichas normas. \r\n\r\nLas cuentas de este subgrupo figurarán en el activo no corriente del balance minorando la partida en la que figure el correspondiente elemento patrimonial\r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
