insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('401','PROVEEDORES, EFECTOS COMERCIALES A PAGAR','N',0,'PROVEEDORES, EFECTOS COMERCIALES A PAGAR',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Deudas con proveedores, formalizadas en efectos de giro aceptados. \r\n\r\nFigurará en el pasivo corriente del balance. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará: \r\na1) Por la recepción \"a conformidad\" de las remesas de los proveedores, con cargo a cuentas del subgrupo       60. \r\na2) Por los envases y embalajes cargados en factura por los proveedores con facultad de su devolución a       éstos, con cargo a la cuenta 406. \r\na3 ) En su caso, por el gasto financiero devengado, con cargo, generalmente, a la cuenta 662. \r\n\r\nb) Se cargará: \r\n     b1) Por la formalización de la deuda en efectos de giro aceptados, con abono a la cuenta 401. \r\n     b2) Por la cancelación total o parcial de las deudas de la empresa con los proveedores, con abono a            cuentas del subgrupo 57. \r\n     b3) Por los \"rappels\" que correspondan a la empresa, concedidos por los proveedores, con abono a la            cuenta 609. \r\n     b4) Por los descuentos, estén o no incluidos en factura, que le concedan a la empresa por pronto pago                  sus proveedores, con abono a la cuenta 606. \r\n     b5) Por las devoluciones de compras efectuadas, con abono a la cuenta 608. \r\n     b6) Por los envases y embalajes devueltos a proveedores que fueron cargados en factura por éstos y            recibidos con facultad de devolución, con abono a la cuenta 406.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('403','PROVEEDORES, EMPRESAS DEL GRUPO','N',0,'PROVEEDORES, EMPRESAS DEL GRUP',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Deudas con las empresas del grupo en su calidad de proveedores, incluso si las deudas se han formalizado en efectos de giro. \r\n\r\nFigurará en el pasivo corriente del balance.\r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará: \r\n    a1) Por la recepción \"a conformidad\" de las remesas de los proveedores, con cargo a cuentas del           subgrupo 60. \r\n    a2) Por los envases y embalajes cargados en factura por los proveedores con facultad de su devolución a           éstos, con cargo a la cuenta 406. \r\n   a3 ) En su caso, por el gasto financiero devengado, con cargo, generalmente, a la cuenta 662. \r\n\r\nb) Se cargará: \r\n   b1) Por la formalización de la deuda en efectos de giro aceptados, con abono a la cuenta 401. \r\n   b2) Por la cancelación total o parcial de las deudas de la empresa con los proveedores, con abono a          cuentas del subgrupo 57. \r\n   b3) Por los \"rappels\" que correspondan a la empresa, concedidos por los proveedores, con abono a la          cuenta 609. \r\n   b4) Por los descuentos, estén o no incluidos en factura, que le concedan a la empresa por pronto pago sus          proveedores, con abono a la cuenta 606. \r\n   b5) Por las devoluciones de compras efectuadas, con abono a la cuenta 608. \r\n   b6) Por los envases y embalajes devueltos a proveedores que fueron cargados en factura por éstos y          recibidos con facultad de devolución, con abono a la cuenta 406. \r\n\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
