ULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('406','ENVASES Y EMBALAJES A DEVOLVER A PROVEEDORES','N',0,'ENVASES Y EMBALAJES A DEVOLVER A PROVEEDORES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Importe de los envases y embalajes cargados en factura por los proveedores, con facultad de devolución a éstos. \r\n\r\nFigurará en el pasivo corriente del balance minorando la cuenta 400. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará por el importe de los envases y embalajes, a la recepción de las mercaderías contenidas en     ellos, con abono a la cuenta 400. \r\n\r\nb) Se abonará: \r\n    b1) Por el importe de los envases y embalajes devueltos, con cargo a la cuenta 400. \r\n    b2) Por el importe de los envases y embalajes que la empresa decida reservarse para su uso así como los           extraviados y deteriorados, con cargo a la cuenta 602. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('407','ANTICIPOS A PROVEEDORES','N',0,'ANTICIPOS A PROVEEDORES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Entregas a proveedores, normalmente en efectivo, en concepto de \"a cuenta\" de suministros futuros. \r\n\r\nCuando estas entregas se efectúen a empresas del grupo, multigrupo, asociadas u otras partes vinculadas deberán desarrollarse las cuentas de tres cifras correspondientes. \r\n\r\nFigurará en el activo corriente del balance en el epígrafe \"Existencias\". \r\n\r\nCon carácter general, su movimiento es el siguiente: \r\n\r\na) Se cargará por las entregas de efectivo a los proveedores, con abono a cuentas del subgrupo 57. \r\n\r\nb) Se abonará por las remesas de mercaderías u otros bienes recibidos de proveedores \"a conformidad\", con     cargo, generalmente, a cuentas del subgrupo 60. \r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
