insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('410','ACREEDORES POR PRESTACIONES DE SERVICIOS','N',0,'ACREEDORES POR PRESTACIONES DE SERVICIOS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Deudas con suministradores de servicios que no tienen la condición estricta de proveedores. \r\n\r\nFigurará en el pasivo corriente del balance. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará: \r\n    a1) Por la recepción \"a conformidad\" de los servicios, con cargo, generalmente, a cuentas del subgrupo           62. \r\n    a2) En su caso, para reflejar el gasto financiero devengado, con cargo, generalmente, a la cuenta 662. \r\n\r\nb) Se cargará: \r\n    b1) Por la formalización de la deuda en efectos de giro aceptados, con abono a la cuenta 411. \r\n    b2) Por la cancelación total o parcial de las deudas de la empresa con los acree-dores, con abono a las           cuentas que correspondan del subgrupo 57. \r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
