insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('419','ACREEDORES POR OPERACIONES EN COMUN','N',0,'ACREEDORES POR OPERACIONES EN COMUN',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Deudas con partícipes en las operaciones reguladas por los artículos 239 a 243 del Código de Comercio y en otras operaciones en común de análogas características. \r\n\r\nFigurará en el pasivo del balance. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará: \r\n    a1) Por las aportaciones recibidas por la empresa como partícipe gestor, con cargo, generalmente, a           cuentas del subgrupo 57. \r\n    a2) Siendo la empresa partícipe gestor, por el beneficio que deba atribuirse a los partícipes no gestores,           con cargo a la cuenta 6510. \r\n    a3) Por la pérdida que corresponde a la empresa como partícipe no gestor, con cargo a la cuenta 6511. \r\n\r\nb) Se cargará:\r\n    b1) Al pago de las deudas, con abono a cuentas del subgrupo 57. \r\n    b2) Siendo la empresa partícipe gestor, por la pérdida que deba atribuirse a los partícipes no gestores           mientras su saldo en la operación en común sea acreedor, con abono a la cuenta 5710.\r\n    b3) Por el beneficio que corresponde a la empresa como partícipe no gestor, con abono a la cuenta 7511.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('43','CLIENTES','N',0,'CLIENTES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('430','CLIENTES','N',0,'CLIENTES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Créditos con compradores de mercaderías y demás bienes definidos en el grupo 3, así como con los usuarios de los servicios prestados por la empresa, siempre que constituyan una actividad principal. \r\n\r\nFigurará en el activo corriente del balance. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará: \r\n    a1) Por las ventas realizadas, con abono a cuentas del subgrupo 70. \r\n    a2) Por los envases y embalajes cargados en factura a los clientes con facultad de su devolución por éstos,           con abono a la cuenta 437. \r\n    a3) En su caso, para reflejar el ingreso financiero devengado, con abono, generalmente, a la cuenta 762. \r\n\r\nb) Se abonará: \r\n    b1) Por la formalización del crédito en efectos de giro aceptados por el cliente, con cargo a la cuenta 431. \r\n    b2) Por la cancelación total o parcial de las deudas de los clientes o la cesión en firme de los rechos de           cobro a terceros, con cargo, generalmente, a cuentas del subgrupo 57. \r\n    b3) Por su clasificación como clientes de dudoso cobro, con cargo a la cuenta 436. \r\n    b4) Por la parte que resultara definitivamente incobrable, con cargo a la cuenta 650. \r\n    b5) Por los \"rappels\" que correspondan a clientes, con cargo a la cuenta 709. \r\n    b6) Por los descuentos, no incluidos en factura, que se concedan a los clientes por pronto pago, con cargo           a la cuenta 706. \r\n    b7) Por las devoluciones de ventas, con cargo a la cuenta 708. \r\n    b8) Por los envases devueltos por clientes que fueron cargados a éstos en factura y enviados con facultad           de devolución, con cargo a la cuenta 437. \r\n    b9) Por lac esión, de los derechos de cobro en operaciones de \"factoring\" en las que la empresa continua           reteniendo sustancialmente los riesgos y beneficios, con cargo a la cuenta 432.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
