insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('434','CLIENTES, EMPRESAS ASOCIADAS','N',0,'CLIENTES, EMPRESAS ASOCIADAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Créditos con las empresas multigrupo y asociadas en su calidad de clientes, incluso si se han formalizado en efectos de giro o son créditos cedidos en operaciones de \"factoring\" en los que la empresa retiene sustancialmente los riesgos y beneficios de los derechos de cobro.\r\n\r\nFigurará en el activo corriente del balance.\r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará: \r\n    a1) Por las ventas realizadas, con abono a cuentas del subgrupo 70. \r\n    a2) Por los envases y embalajes cargados en factura a los clientes con facultad de su devolución por éstos,           con abono a la cuenta 437. \r\n    a3) En su caso, para reflejar el ingreso financiero devengado, con abono, generalmente, a la cuenta 762. \r\n\r\nb) Se abonará: \r\n    b1) Por la formalización del crédito en efectos de giro aceptados por el cliente, con cargo a la cuenta 431. \r\n    b2) Por la cancelación total o parcial de las deudas de los clientes o la cesión en firme de los rechos de           cobro a terceros, con cargo, generalmente, a cuentas del subgrupo 57. \r\n    b3) Por su clasificación como clientes de dudoso cobro, con cargo a la cuenta 436. \r\n    b4) Por la parte que resultara definitivamente incobrable, con cargo a la cuenta 650. \r\n    b5) Por los \"rappels\" que correspondan a clientes, con cargo a la cuenta 709. \r\n    b6) Por los descuentos, no incluidos en factura, que se concedan a los clientes por pronto pago, con cargo           a la cuenta 706. \r\n    b7) Por las devoluciones de ventas, con cargo a la cuenta 708. \r\n    b8) Por los envases devueltos por clientes que fueron cargados a éstos en factura y enviados con facultad           de devolución, con cargo a la cuenta 437. \r\n    b9) Por lac esión, de los derechos de cobro en operaciones de \"factoring\" en las que la empresa continua           reteniendo sustancialmente los riesgos y beneficios, con cargo a la cuenta 432.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
