insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('436','CLIENTES DE DUDOSO COBRO','N',0,'CLIENTES DE DUDOSO COBRO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Saldos de clientes, incluidos los formalizados en efectos de giro o los cedidos en operaciones de \"factoring\" en los que la empresa retiene sustancialmente los riesgos y beneficios de los derechos de cobro, en los que concurran circunstancias que permitan razonablemente su calificación como de dudoso cobro. \r\n\r\nFigurará en el activo corriente del balance. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará por el importe de los saldos de dudoso cobro, con abono a la cuenta 430, 431 0 432.\r\n\r\nb) Se abonará: \r\n    b1) Por las insolvencias firmes, con cargo a la cuenta 650. \r\n    b2) Por el cobro total de los saldos, con cargo a cuentas del subgrupo 57. \r\n    b3) Al cobro parcial, con cargo a cuentas del subgrupo 57 en la parte cobrada, y a la cuenta 650 por lo que           resultara incobrable. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
