insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('437','ENVASES Y EMBALAJES A DEVOLVER POR CLIENTES','N',0,'ENVASES Y EMBALAJES A DEVOLVER POR CLIENTES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Importe de los envases y embalajes cargados en factura a los clientes, con facultad de devolución por éstos. \r\n\r\nFigurará en el activo corriente del balance minorando la cuenta 430. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará por el importe de los envases y embalajes al envío de las mercaderías contenidas en ellos, con     cargo a la cuenta 430. \r\n\r\nb) Se cargará: \r\n    b1) A la recepción de los envases y embalajes devueltos, con abono a la cuenta 430. \r\n    b2) Cuando transcurrido el plazo de devolución, ésta no se hubiera efectuado, con abono a la cuenta 704. \r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('4370','ANTICIPOS DE CLIENTES','N',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('438','ANTICIPOS DE CLIENTES','N',0,'ANTICIPOS DE CLIENTES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Entregas de clientes, normalmente en efectivo, en concepto de \"a cuenta\" de suministros futuros. \r\n\r\nCuando estas entregas se efectúen por empresas del grupo, multigrupo, asociadas u otras partes vinculadas deberán desarrollarse las cuentas de tres cifras correspondientes. \r\n\r\nFigurará en el pasivo corriente del balance. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará por las recepciones en efectivo, con cargo a la cuenta que corresponda del subgrupo 57. \r\n\r\nb) Se cargará por las remesas de mercaderías u otros bienes a los clientes, con abono, generalmente, a cuentas del subgrupo 70. \r\n\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('44','DEUDORES VARIOS','N',0,'DEUDORES VARIOS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Cuando los deudores sean empresas del grupo, multigrupo o asociadas u otras partes vinculadas, se abrirán cuentas de tres cifras que específicamente recojan los créditos con las mismas, incluidos los formalizados en efectos de giro.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('440','DEUDORES VARIOS','N',0,'DEUDORES VARIOS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Créditos con compradores de servicios que no tienen la condición estricta de clientes y con otros deudores de tráfico no incluidos en otras cuentas de este grupo. \r\n\r\nEn esta cuenta se contabilizará también el importe de las donaciones y legados a la explotación concedidos a la empresa, que se liquiden mediante la entrega de efectivo u otros activos financieros, excluidas las subvenciones que deben registrarse en cuentas del subgrupo 47. \r\n\r\nFigurará en el activo corriente del balance. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará: \r\n    a1) Por la prestación de servicios, con abono a cuentas del subgrupo 75. \r\n    a2) Por la donación o legado de explotación concedido, con abono a cuentas del subgrupo 74. \r\n    a3) En su caso, para reflejar el ingreso financiero devengado, con abono, generalmente, a la cuenta 762. \r\n\r\nb) Se abonará: \r\n    b1) Por la formalización del crédito en efectos de giro aceptados por el deudor, con cargo a la cuenta 441. \r\n    b2) Por la cancelación total o parcial de las deudas, con cargo, generalmente, a cuentas del subgrupo 57. \r\n    b3) Por su clasificación como deudores de dudoso cobro, con cargo a la cuenta 446.\r\n    b4) Por la parte que resultara definitivamente incobrable, con cargo a la cuenta 650. \r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
