insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('441','DEUDORES, EFECTOS COMERCIALES A COBRAR','N',0,'DEUDORES, EFECTOS COMERCIALES A COBRAR',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Créditos con deudores, formalizados en efectos de giro aceptados. \r\n\r\nSe incluitán en esta cuenta los efectos en cartera, los descontados, los entregados en gestión de cobro y los impagados; en este último caso sólo cuando no deban reflejarse en la cuenta 446.\r\n\r\nFigurará en el activo corriente del balance. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará:\r\n    a1) Por la prestación de servicios, aceptando los perceptores efectos de giro, con abono a cuentas del           subgrupo 57.\r\n    a2) Por la formalización del derecho de cobro en efectos de giro aceptado por el perceptor del servicio o          deudor, con abono, generalmente, a la cuenta 440. \r\n\r\nb) Se abonará: \r\n    b1) Por el cobro de los efectos al vencimiento, con cargo a cuentas del subgrupo 57. \r\n    b2) Por su clasificación como de dudoso cobro, con cargo a la cuenta 446.\r\n    b3) Por la parte que resultara definitivamente incobrable, con cargo a la cuenta 650. \r\n\r\nLa financiación obtenida por el descuento de efectos, constituye una deuda que deberá recogerse, generalmente, en las cuentas correspondientes del subgrupo 52. En consecuencia, al vencimiento de los efectos atendidos, se abonará la cuenta 4411, con cargo a la cuenta 5208.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
