insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('449','DEUDORES POR OPERACIONES EN COMUN','N',0,'DEUDORES POR OPERACIONES EN COMUN',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Créditos con partícipes en las operaciones reguladas por los artículos 239 a 243 del Código de Comercio y en otras operaciones en común de análogas características. \r\n\r\nFigurará en el activo del balance. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará: \r\n    a1) Por las aportaciones realizadas por la empresa como partícipe no gestor, con abono, generalmente, a           cuentas del subgrupo 57. \r\n    a2) Siendo la empresa partícipe gestor, por la pérdida que deba atribuirse a los partícipes no gestores, con           abono a la cuenta 7510. \r\n   a3) Por el beneficio que corresponde a la empresa como partícipe no gestor, con abono a la cuenta 7511. \r\n\r\nb) Se abonará:\r\n    b1) Por el cobro de los créditos, con cargo a cuentas del subgrupo 57. \r\n    b2) Siendo la empresa partícipe gestor, por el beneficio que debe atribuirse a los partícipes no gestores           mientras su saldo en la operación en común sea deudor, con cargo la cuenta 6510.\r\n    b3) Por la pérdida que corresponda a la empresa como partícipe no gestor, con cargo a la cuenta 6511.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
