insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('4708','HACIENDA PUBLICA DEUDORA POR SUBVENCIONES CONCEDIDAS','N',0,'HACIENDA PUBLICA DEUDORA POR SUBVENCIONES CONCEDIDAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Créditos con la Hacienda Pública por razón de subvenciones concedidas. \r\n\r\na) Se cargará cuando sean concedidas las subvenciones, con abono, generalmente, a las cuentas 172, 740 o cuentas del subgrupo 94. \r\n\r\nb) Se abonará al cobro, con cargo, generalmente, a cuentas de subgrupo 57. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('4709','HACIENDA PUBLICA, DEUDORA POR DEVOLUCION DE IMPUESTOS','N',0,'HACIENDA PUBLICA, DEUDORA POR DEVOLUCION DE IMPUESTOS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Créditos con la Hacienda Pública por razón de devolución de impuestos. \r\n\r\na) Se cargará: \r\n    a1) Por las retenciones y pagos a cuenta a devolver, con abono a la cuenta 473. \r\n    a2) Por la cuota de ejercicios anteriores que recupera la empresa como consecuencia de liquidaciones           fiscales del impuesto o impuestos sobre el beneficio, con abono, a la cuenta 6300 o, en su caso, a la           cuenta 8300.\r\n   a3) Tratándose de devoluciones de otros impuestos que hubieran sido contabilizados en cuentas de                    gastos, con abono a la cuenta 636. Si hubieran sido cargados en cuentas del grupo 2, serán éstas las              cuentas abonadas por el importe de la devolución. \r\n\r\nb) Se abonará al cobro, con cargo a cuentas del subgrupo 57. \r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
