insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('471','ORGANISMOS DE LA SEGURIDAD SOCIAL, DEUDORES','N',0,'ORGANISMOS DE LA SEGURIDAD SOCIAL, DEUDORES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Créditos a favor de la empresa, de los diversos Organismos de la Seguridad Social, relacionados con las prestaciones sociales que ellos efectúan. \r\n\r\nFigurará en el activo del balance. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará por las prestaciones a cargo de la Seguridad Social, con abono, generalmente, a cuentas del     subgrupo 57.\r\n\r\nb) Se abonará al cancelar el crédito.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('472','HACIENDA PUBLICA, IVA SOPORTADO','N',0,'HACIENDA PUBLICA, IVA SOPORTADO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'IVA devengado con motivo de la adquisición de bienes y servicios y de otras operaciones comprendidas en el texto legal, que tenga carácter deducible.\r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se cargará: \r\n    a1) Por el importe del IVA deducible cuando se devengue el impuesto, con abono a cuentas de acreedores           o proveedores de los grupos 1, 4 ó 5 o a cuentas del subgrupo 57. En los casos de cambio de                     afectación de bienes, con abono a la cuenta 477. \r\n   a2) Por las diferencias positivas que resulten en el IVA deducible correspondiente a operaciones de bienes o          servicios del activo corriente o de bienes de inversión al practicarse las regularizaciones previstas en la           Regla de Prorrata, con abono a la cuenta 639. \r\n\r\nb) Se abonará:\r\n     b1) Por el importe del IVA deducible que se compensa en la declaración-liquidación del período de            liquidación, con cargo a la cuenta 477. Si después de formulado este asiento subsistiera saldo en la            cuenta 472, el importe del mismo se cargará a la cuenta 4700.\r\n     b2) Por las diferencias negativas que resulten en el IVA deducible correspondiente a operaciones de            bienes o servicios del activo corriente o de bienes de inversión al practicarse las regularizaciones            previstas en la Regla de Prorrata, con cargo a la cuenta 634. \r\n\r\nc) Se cargará o se abonará, con abono o cargo a cuentas de los grupos 1, 2, 4 ó 5, por el importe del IVA deducible que corresponda en los casos de alteraciones de precios posteriores al momento en que se hubieren realizado las operaciones gravadas, o cuando éstas quedaren sin efecto total o parcialmente, o cuando deba reducirse la base imponible en virtud de descuentos y bonificaciones otorgadas después del devengo del impuesto.\r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
