insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('473','HACIENDA PUBLICA, RETENCIONES Y PAGOS A CUENTA','N',0,'HACIENDA PUBLICA, RETENCIONES Y PAGOS A CUENTA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Cantidades retenidas a la empresa y pagos realizados por la misma a cuenta de impuestos.\r\n\r\nCon carácter general, su movimiento es el siguiente:\r\n\r\na) Se cargará por el importe de la retención o pago a cuenta, con abono, generalmente, a cuentas del grupo 5      y a cuentas del subgrupo 76.\r\n\r\nb) Se abonará:\r\n    b1) Por el importe de las retenciones soportadas y los ingresos a cuenta del impuesto sobre sociedades                  realizados, hasta el importe de la cuota líquida del período, con cargo a la cuenta 6300 o, en su caso,           a la cuenta 8300.\r\n    b2) Por el importe de las retenciones soportadas e ingresos a cuenta del impuesto sobre sociedades que           deban ser objeto de devolución a la empresa, con cargo a la cuenta 4709. \r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
