insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('474','ACTIVOS POR IMPUESTO DIFERIDO','N',0,'ACTIVOS POR IMPUESTO DIFERIDO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Activos por diferencias temporarias deducibles, créditos por el derecho a compensar en ejercicios posteriores las bases imponibles negativas pendientes de compensación y deducciones y otras ventajas fiscales no utilizadas, que queden pendientes de aplicar en la liquidación de los impuestos sobre beneficios. \r\n\r\nEn esta cuenta figurará el importe íntegro de los activos por impuesto diferido correspondiente a los impuestos sobre beneficios, no siendo admisible su compensación con los pasivos por impuesto diferido, ni aún dentro de un mismo ejercicio. Todo ello, sin perjuicio de lo dispuesto en la tercera parte del presente Plan, a los efectos de su presentación en las cuentas anuales. \r\n\r\nFigurará en el activo no corriente del balance\r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('4740','ACTIVOS POR DIFERENCIAS TEMPORARIAS DEDUCIBLES','N',0,'ACTIVOS POR DIFERENCIAS TEMPORARIAS DEDUCIBLES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Activos fiscales por diferencias que darán lugar a menores cantidades a pagar o mayores cantidades a devolver por impuestos sobre beneficios en ejercicios futuros, normalmente a medida que se recuperen los activos o se liquiden los pasivos de los que se derivan.\r\n\r\na) Se cargará:\r\n     a1) Por el importe del activo por diferencias deducibles originado en el ejercicio, con abono, generalmente,             a la cuenta 6301. \r\n     a2) Por el importe de los activos por diferencias temporarias deducibles que surja en una transacción o            suceso que se hubiese reconocido directamente en una partida de patrimonio neto, con abono a la            cuenta 8301.\r\n    a3) Por el aumento de los activos por diferencias deducibles, con abono, generalmente, a la cuenta 638. \r\n    a4) Por el aumento de los activos por diferencias temporarias deducibles originados en una transacción o           suceso que se hubiese reconocido directamente en una partida de patrimonio neto, con abono, a la           cuenta 838.\r\n\r\nb) Se abonará: \r\n    b1) Por las reducciones de activos por diferencias deducibles, con cargo, generalmente, a la cuenta 633.\r\n    b2) Por las reducciones de los activos por diferencias temporarias deducibles originadas en una transacción           o suceso que se hubiese reconocido directamente en una partida del patrimonio neto, con cargo a la           cuenta 833.\r\n    b3) Cuando se imputen los activos por diferencias deducibles, generalmente, con cargo a la cuenta 6301.\r\n    b4) Cuando se imputen los activos por diferencias temporarias deducibles originados en una transacción o           suceso que se hubiese reconocido directamente en una partidal del patrimonio neto, con cargo a la           cuenta 8301.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('4742','DERECHOS POR DEDUCCIONES Y BONIFICACIONES PDTES. DE APLICAR','N',0,'DERECHOS POR DEDUCCIONES Y BONIFICACIONES PDTES. DE APLICAR',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Importe de la disminución del impuesto sobre beneficios a pagar en el futuro derivada de la existencia de deducciones o bonificaciones de dicho impuesto pendientes de aplicación. \r\n\r\na) Se cargará: \r\n    a1) Por el crédito impositivo derivado de la deducción o bonificación en el impuesto sobre beneficios                     obtenida en el ejercicio, con abono, generalmente, a la cuenta 6301. \r\n    a2) Por el aumento del crédito impositivo, con abono, generalmente, a la cuenta 638. \r\n\r\nb) Se abonará: \r\n    b1) Por la disminución del crédito impositivo, con cargo, generalmente, a la cuenta 633. \r\n    b2) Por la aplicación fiscal de las deducciones o bonificaciones de ejercicios anteriores, con cargo,                     generalmente, a la cuenta 6301. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('4745','CREDITOS POR PERDIDAS A COMPENSAR DEL EJERCICIO...','N',0,'CREDITOS POR PERDIDAS A COMPENSAR DEL EJERCICIO...',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Importe de la reducción del impuesto sobre beneficios a pagar en el futuro derivada de la existencia de bases imponibles negativas de dicho impuesto pendientes de compensación. \r\n\r\na) Se cargará: \r\n    a1) Por el crédito impositivo derivado de la base imponible negativa en los impuestos sobre beneficios                     obtenida en el ejercicio, con abono, generalmente, a la cuenta 6301. \r\n    a2) Por el aumento del crédito impositivo, con abono, generalmente, a la cuenta 638. \r\n\r\nb) Se abonará: \r\n    b1) Por las reducciones del crédito impositivo, con cargo, generalmente, a la cuenta 633. \r\n    b2) Cuando se compensen las bases imponibles negativas de ejercicios anteriores, con cargo,           generalmente, a la cuenta 6301. \r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
