insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('479','PASIVOS POR DIFERENCIAS TEMPORARIAS IMPONIBLES','N',0,'PASIVOS POR DIFERENCIAS TEMPORARIAS IMPONIBLES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Diferencias que darán lugar a mayores cantidades a pagar o menores cantidades a devolver por impuestos sobre beneficios en ejercicios futuros, normalmente a medida que se recuperen los activos o se liquiden los pasivos de los que se derivan. \r\n\r\nEn esta cuenta figurará el importe íntegro de los pasivos por impuesto diferido, no siendo admisible su compensación con los activos por impuesto diferido del impuesto sobre beneficios. Todo ello, sin perjuicio de lo dispuesto en la tercera parte del presente Plan, a los efectos de su presentación en las cuentas anuales. \r\n\r\nFigurará en el pasivo no corriente del balance. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará: \r\n    a1) Por el importe de los pasivos por diferencias imponibles originados en el ejercicio, con cargo,                     generalmente, a la cuenta 6301. \r\n    a2) Por el importe de los pasivos por diferencias temporarias imponibles que surjan en una transacción o           suceso que se hubiese reconocido directamente en una partida del patrimonio neto, con cargo a la           cuenta 8301.\r\n   a3) Por el aumento de los pasivos por diferencias imponibles, con cargo, generalmente, a la cuenta 633. \r\n   a4) Por el aumento de los pasivos por diferencias temporarias imponibles originados en una trasacción o          suceso que se hubiese reconocido directamente en una partida de patrimonio neto, con cargo a la          cuenta 833.\r\n\r\nb) Se cargará: \r\n     b1) Por las reducciones de los pasivos por diferencias imponibles, con abono, generalmente, a la cuenta                638. \r\n     b2) Por las reducciones de los pasivos por diferencias temporarias imponibles originados en una            transacción o suceso que se hubiese reconocido directamente en una partida del patrimonio neto, con            abono, a la cuenta 838.\r\n    b3) Cuando se cancele el pasivo por diferencias temporarias imponibles, generalmente, con abono a la           cuenta 6301. \r\n    b4) Cuando se cancelen los pasivos por diferencias temporarias imponibles originado en una transacción           o suceso que se hubieses reconocido directamente en una partida de patrmonio neto, con abono a la           cuenta 8301. \r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
