insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('485','INGRESOS ANTICIPADOS','N',0,'INGRESOS ANTICIPADOS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ingresos contabilizados en el ejercicio que se cierra y que corresponden al siguiente. Figurará en el pasivo corriente del balance. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará, al cierre del ejercicio, con cargo a las cuentas del grupo 7 que hayan registrado los ingresos     correspondientes al posterior. \r\n\r\nb) Se cargará, al principio del ejercicio siguiente, con abono a cuentas del grupo 7.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('49','DETERIORO VALOR DE CREDITOS COMERCIALES Y PROV. CORTO PLAZO','N',0,'DETERIORO VALOR DE CREDITOS COMERCIALES Y PROV. CORTO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Correcciones por deterioro del valor de los activos financieros por operaciones comerciales debido a situaciones latentes de insolvencia de clientes y de otros deudores incluidos en los subgrupos 43 y 44 y obligaciones actuales, al cierre del ejercicio, por los gastos a incurrir tras la entrega de los bienes o la prestación de servicios, como, por ejemplo, la cobertura de gastos por devoluciones de ventas, garantías sobre productos vendidos y otros conceptos análogos. \r\n\r\nLas cuentas de este subgrupo, salvo la 499. Provisión para operaciones comerciales, figurarán en el activo del balance minorando la partida en la que figure el correspondiente elemento patrimonial.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('490','DETERIORO DEL VALOR DE CREDITOS POR OPERACIONES COMERCIALES','N',0,'DETERIORO DEL VALOR DE CREDITOS POR OPERACIONES COMERCIALES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Importe de las correcciones valorativas por deterioro de créditos incobrables, con origen en operaciones de tráfico. \r\n\r\nSu movimiento es el siguiente, según la alternativa adoptada por la empresa: \r\n\r\n1. Cuando la empresa cifre el importe del deterioro al final del ejercicio mediante una estimación global del riesgo de fallidos existentes en los saldos de clientes y deudores, siempre y cuando su importe, individualmente considerados, no sea significativo: \r\n\r\na) Se abonará, al final del ejercicio, por la estimación realizada, con cargo a la cuenta 694. \r\n\r\nb) Se cargará, igualmente al final del ejercicio, por la corrección realizada al cierre del ejercicio precedente, con abono a la cuenta 794. \r\n\r\n2. Cuando la empresa cifre el importe del deterioro mediante un sistema individualizado de seguimiento de saldos de clientes y deudores: \r\n\r\na) Se abonará, a lo largo del ejercicio, por el importe de la pérdida que se vaya estimando, con cargo a la cuenta 694. \r\n\r\nb) Se cargará a medida que se vayan dando de baja los saldos de clientes y deudores para los que se dotó la cuenta correctora de forma individualizada o cuando la pérdida estimada disminuya como consecuencia de un evento posterior, con abonoa la cuenta 794.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('493','DETERIORO VALOR CREDITOS POR OPERAC. COMERCI. PARTES VINCUL.','N',0,'DETERIORO VALOR CREDITOS POR OPERAC. COMERCI. PARTES VINCUL.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Importe de las correcciones valorativas por deterioro de créditos incobrables, con origen en operaciones de tráfico efectuadas con partes vinculadas.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
