insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('499','PROVISIONES PARA OPERACIONES COMERCIALES','N',0,'PROVISIONES PARA OPERACIONES COMERCIALES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Provisiones para el reconocimiento de obligaciones presentes derivadas del tráfico comercial de la empresa. \r\n\r\nFigurarán en el pasivo del balance. \r\n\r\nLas provisiones para operaciones comerciales cuya cancelación se prevea en el largo plazo deberán figurar en el pasivo no corriente del balance en el epígrafe \"Provisiones largo plazo\". \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('4994','PROVISION POR CONTRATOS ONEROSOS','N',0,'PROVISION POR CONTRATOS ONEROSOS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Provisión que surge cuando los costes que conlleva el cumplimiento de un contrato exceden a los beneficios económicos que se esperan recibir del mismo. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará, al cierre del ejercicio, por el importe de la estimación realizada, con cargo a la cuenta 6954. \r\n\r\nb) Se cargará: \r\n    b1) Al cierre del ejercicio, si la empresa opta por cumplir el contrato, por el exceso de provisión           contabilizada, con abono a la cuenta 79544. \r\n    b2) Si la empresa opta por la cancelación del contrato, con abono, generalmente, a cuentas del subgrupo           57.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('4999','PROVISION PARA OTRAS OPERACIONES COMERCIALES','N',0,'PROVISION PARA OTRAS OPERACIONES COMERCIALES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Provisión para cobertura de gastos por devoluciones de ventas, garantías de reparación, revisiones y otros conceptos análogos. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará, al cierre del ejercicio, por el importe de la estimación realizada, con cargo a la cuenta 6959.\r\n\r\nb) Se cargará, al cierre del ejercicio, por la dotación efectuada en el año anterior, con abono a la cuenta 79549.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('5','CUENTAS FINANCIERAS','N',0,'CUENTAS FINANCIERAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Instrumentos financieros por operaciones no comerciales, es decir, por operaciones ajenas al tráfico con vencimiento no superior a un año y medios líquidos disponibles.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('50','EMPRESTITOS, DEUDAS ESPECIALES Y OTRAS EMISIONES CORTO PLAZO','N',0,'EMPRESTITOS, DEUDAS ESPECIALES Y OTRAS EMISIONES CORTO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Financiación ajena instrumentada en valores negociables y acciones u otras participaciones en el capital de la empresa que atendiendo a las características económicas de la emisión, deban considarse como pasivo financiero, cuyo vencimiento vaya a producirse en un plazo no superior a un año. \r\n\r\nLas cuentas de este subgrupo figurarán en el pasivo corriente del balance. \r\n\r\nLa parte de las deudas a largo plazo que tenga vencimiento a corto deberá figurar en el pasivo corriente del balance; a estos efectos se traspasará a este subgrupo el importe que representen las deudas a largo plazo con vencimiento a corto de las cuentas correspondientes de los subgrupos 15 y 17. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('500','OBLIGACIONES Y BONOS A CORTO PLAZO','N',0,'OBLIGACIONES Y BONOS A CORTO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Obligaciones y bonos en circulación no convertibles en acciones cuyo vencimiento vaya a producirse en un plazo no superior a un año. \r\n\r\nCon carácter general, su movimiento es el siguiente: \r\n\r\na) Se abonará: \r\n    a1) En el momento de la emisión, por el importe recibido, minorado en los gastos de la transacción, con           cargo a cuentas del subgrupo 57. \r\n    a2) Por el gasto financiero devengado hasta el valor de reembolso de la deuda, con cargo, generalmente, a           la cuenta 661.\r\n\r\nb) Se cargará por el importe a reembolsar de los valores, a la amortización de los mismos, con abono a la cuenta 509\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('501','OBLIGACIONES Y BONOS CONVERTIBLES A CORTO PLAZO','N',0,'OBLIGACIONES Y BONOS CONVERTIBLES A CORTO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Componente de pasivo financiero de las obligaciones y bonos convertibles en acciones cuyo vencimiento vaya a producirse en un plazo no superior a un año, que se califican como instrumentos financieros compuestos.\r\n\r\nCon carácter general, su movimiento es el siguiente: \r\n\r\na) Se abonará: \r\n    a1) En el momento de la emisión, por el importe recibido, minorado en los gastos de la transacción, con           cargo a cuentas del subgrupo 57. \r\n    a2) Por el gasto financiero devengado hasta el valor de reembolso de la deuda, con cargo, generalmente, a           la cuenta 661.\r\n\r\nb) Se cargará por el importe a reembolsar de los valores, a la amortización de los mismos, con abono a la cuenta 509\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('502','ACCIONES O PARTICIPACIONES A CORTO PLAZO CONTAB. COMO PASIVO','N',0,'ACCIONES O PARTICIPACIONES A CORTO PLAZO CONTAB. COMO PASIVO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Capital social escriturado y, en su caso, prima de emisión o asunción en las sociedads que revistan forma mercantil que, atendiendo a las características de la emisión, deba contabilizarse como pasivo financiero y cuyo rescate se prevea a corto plazo. \r\n\r\nEn particular, determinadas acciones rescatables y acciones o participaciones sin voto. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará por el capital inicial y las sucesivas ampliaciones, en el momento de su inscripción en el         Registro Mercantil, con cargo a la cuenta 199. \r\n\r\nb) Se cargará por la cancelación o reducciones del mismo y a la extinción de la sociedad, una vez transcurrido     el período de liquidación.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('505','DEUDAS REPRESENTADAS EN OTROS VALORES NEGOC. A CORTO PLAZO','N',0,'DEUDAS REPRESENTADAS EN OTROS VALORES NEGOC. A CORTO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Otros pasivos financieros cuyo vencimiento vaya a producirse en un plazo no superior a un año, representados en valores negociables, ofrecidos al ahorro público, distintos de los anteriores.\r\n\r\nSu contenido y movimiento es análogo al señalado para la cuenta 501 ó 500, dependiendo de si se trata de un instrumento financiero compuesto o no.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('506','INTERESES DE EMPRESTITOS Y OTRAS EMISIONES ANALOGAS','N',0,'INTERESES DE EMPRESTITOS Y OTRAS EMISIONES ANALOGAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Intereses a pagar, con vencimiento a corto plazo, de empréstitos y otras emisiones análogas. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará por el importe de los intereses explícitos devengados durante el ejercicio, incluidos los no     vencidos, con cargo a la cuenta 661. \r\n\r\nb) Se cargará: \r\n     b1) Por la retención a cuenta de impuestos, cuando proceda, con abono a la cuenta 475. \r\n     b2) Al pago, con abono a cuentas del subgrupo 57. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
