insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('510','DEUDAS A CORTO PLAZO CON ENTIDADES DE CREDITO VINCULADAS','N',0,'DEUDAS A CORTO PLAZO CON ENTIDADES DE CREDITO VINCULADAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Las contraídas con entidades de crédito vinculadas por préstamos recibidos y otros débitos, con vencimiento no superior a un año.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
