insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('5303','PARTICIPACIONES A CORTO PLAZO EN EMPRESAS DEL GRUPO','N',0,'PARTICIPACIONES A CORTO PLAZO EN EMPRESAS DEL GRUPO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'El movimiento de las cuentas es el siguiente: \r\n\r\na) Se cargará:\r\n   a1) A la suscripción o compra, con abono, generalmente, a cuentas del subgrupo 57 y, en su caso, a la          cuenta 539. \r\n   a2) En su caso, en el momento en que el importe recuperable sea superior al valor contable de las          inversiones, hasta el límite de los ajustes valorativos negativos previos imputados directamente al          patrimonio neto, con abono a las cuentas 991 ó 992.\r\n\r\nb) Se abonará:\r\n    b1) En su caso, por el importe del deterioro estimado, hasta el límite de los ajustes valorativos positivos            previos imputados directamente a patrimonio neto, con cargo a las cuentas 891 u 892.\r\n    b2) Por las enajenaciones y en general por su baja del activo, con cargo, generalmente, a cuentas del           subgrupo 57, si existen desembolsos pendientes a la cuenta 538 y en caso de pérdidas a la cuenta 666\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('5304','PARTICIPACIONES A CORTO PLAZO EN EMPRESAS ASOCIADAS','N',0,'PARTICIPACIONES A CORTO PLAZO EN EMPRESAS ASOCIADAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'El movimiento de las cuentas es el siguiente: \r\n\r\na) Se cargará:\r\n   a1) A la suscripción o compra, con abono, generalmente, a cuentas del subgrupo 57 y, en su caso, a la          cuenta 539. \r\n   a2) En su caso, en el momento en que el importe recuperable sea superior al valor contable de las          inversiones, hasta el límite de los ajustes valorativos negativos previos imputados directamente al          patrimonio neto, con abono a las cuentas 991 ó 992.\r\n\r\nb) Se abonará:\r\n    b1) En su caso, por el importe del deterioro estimado, hasta el límite de los ajustes valorativos positivos            previos imputados directamente a patrimonio neto, con cargo a las cuentas 891 u 892.\r\n    b2) Por las enajenaciones y en general por su baja del activo, con cargo, generalmente, a cuentas del           subgrupo 57, si existen desembolsos pendientes a la cuenta 538 y en caso de pérdidas a la cuenta 666\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('5305','PARTICIPACIONES A CORTO PLAZO EN OTRAS PARTES VINCULADAS','N',0,'PARTICIPACIONES A CORTO PLAZO EN OTRAS PARTES VINCULADAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'El movimiento de la cuenta citada es el siguiente:\r\n\r\na) Se cargará:\r\n    a1) A la suscripción o compra, con abono, generalmente, a cuentas del subgrupo 57 y, en su caso, a la           cuenta 539.\r\n    a2) Por las variaciones en su valor razonable, con abono a la cuenta 763.\r\n\r\nb) Se abonará:\r\n    b1) Por las variaciones en su valor razonable, con cargo a la cuenta 663.\r\n    b2) Por las enajenaciones y en general por su baja del activo, con cargo, generalmente, a cuentas del           subgrupo 57 y si existen desembolsos pendientes a la cuenta 539.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('531','VALORES REPRESENTATIVOS DEUDA A CORTO PLAZO PART. VINCULADAS','N',0,'VALORES REPRESENTATIVOS DEUDA A CORTO PLAZO PART. VINCULADAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Inversiones a corto plazo en obligaciones, bonos u otros valores representativos de deuda, incluidos aquellos que fijan su rendimiento en función de índices o sistemas análogos, emitidos por partes vinculadas, con vencimiento no superior a un año. \r\n\r\nFigurará en el activo corriente del balance. \r\n\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('5313','VALORES REPRESENTATIVOS DEUDA CORTO PLAZO, EMP. GRUPO','N',0,'VALORES REPRESENTATIVOS DEUDA CORTO PLAZO, EMP. GRUPO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'El movimiento de la cuenta es el siguiente: \r\n\r\na) Se cargará:\r\n    a1) A la suscripción o compra, por el precio de adquisición, excluidos los intereses explícitos devengados y           no vencidos, con abono a cuentas del subgrupo 57. \r\n    a2) Por el ingreso financiero devengado hasta alcanzar el valor de reembolso del valor, con abono,           generalmente, a la cuenta 761.\r\n\r\nb) Se abonará por las enajenaciones, amortizaciones anticipadas o baja del activo de los valores, con cargo,     generalmente, a cuentas del subgrupo 57 y en caso de pérdidas a la cuenta 666. \r\n\r\nc) Si los valores se clasifican en la categoría de \"Activos financieros mantenidos para negociar\" o se trata de      activos financieros híbridos, se cargará o abonará, por las variaciones en su valor razonable, con abono o       cargo, respectivamente, a las cuentas 900 y 800, salvo la parte correspondiente a diferencias de cambo        que se registrará con abono o cargo a las cuentas 768 y 668. También se cargará cuando se produzca el    deterioro del valor por el saldo negativo acumulado en el patrimonio neto, con abono a la cuenta 902.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
