insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('54','OTRAS INVERSIONES FINANCIERAS TEMPORALES','N',0,'OTRAS INVERSIONES FINANCIERAS TEMPORALES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Inversiones financieras temporales no relacionadas con personas o entidades vinculadas, cualquiera que sea su forma de instrumentación, incluidos los intereses devengados, con vencimiento no superior a un año. \r\n\r\nLa parte de las inversiones a largo plazo que tenga vencimiento a corto deberá figurar en el activo corriente del balance, en el epígrafe \"Inversiones financieras a corto plazo\"; a estos efectos se traspasará a este subgrupo el importe que represente la inversión a largo plazo con vencimiento a corto plazo de las cuentas correspondientes del subgrupo 25.\r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('540','INVERSIONES FINANCIERAS TEMPORALES EN INSTRUM. DE PATRIMONIO','N',0,'INVERSIONES FINANCIERAS TEMPORALES EN INSTRUM. DE PATRIMONIO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Inversiones a corto plazo en derechos sobre el patrimonio neto -acciones con o sin cotización en un mercado regulado u otros valores, tales como, participaciones en instituciones de inversión colectiva, o participaciones en sociedades de responsabilidad limitada- de entidades que no tengan la consideración de partes vinculadas. \r\n\r\nFigurará en el activo corriente del balance.\r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará:\r\n    a1) A la suscripción o compra, con abono a cuentas del subgrupo 57 y, en su caso, a la cuenta 549. \r\n   a2) Por las variaciones en su valor razonavle, con abono a la cuenta 763.\r\n\r\nb) Se abonará:\r\n    b1) Por las variaciones en su valor razonable, con cargo a la cuenta 663.\r\n    b2) Por las enajenaciones y en general por la baja del activo, con cargo, generalmente, a cuentas del subgrupo 57, si existen desembolsos pendientes a la cuenta 549.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('541','VALORES REPRESENTATIVOS DE DEUDAS A CORTO PLAZO','N',0,'VALORES REPRESENTATIVOS DE DEUDAS A CORTO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Inversiones a corto plazo, por suscripción o adquisición de obligaciones, bonos u otros valores de renta fija, incluidos aquellos que fijan su rendimiento en función de índices o sistemas análogos. Cuando los valores suscritos o adquiridos hayan sido emitidos por partes vinculadas, la inversión se reflejará en la cuenta 531. \r\n\r\nFigurará en el activo corriente del balance. \r\n\r\nCon carácter general, su movimiento es el siguiente: \r\n\r\na) Se cargará:\r\n    a1) A la suscripción o compra, por el precio de adquisición, excluidos los intereses explícitos devengados  y           no vencidos, con abono, a cuentas del subgrupo 57. \r\n    a2) Por el ingreso financiero devengado hasta alcanzar el valor de reembolso del valor, co abono,           generalmente, a la cuenta 761.\r\n\r\nb) Se abonará por la enajenación, amortización o baja del activo de los valores, con cargo, generalmente, a     cuentas del subgrupo 57 y en caso de pérdidas a la cuenta 666. \r\n\r\nc) Si los valores se clasifican en la categoría de \"Activos financieros disponibles para la venta\"  se cargará o abonará, por las variaciones en su valor razonable, con abono o  cargo, respectivamente, a las cuentas 900 y 800, salvo la parte correspondiente a difrencias de cambio que se registrará con abono o cargo a las cuentas 768 y 668. También se cargará cuando se produzca el deterioro del valor por el saldo negativo acumulado en el patrimonio neto, con abono a la cuenta 902.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('542','CREDITOS A CORTO PLAZO','N',0,'CREDITOS A CORTO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Los préstamos y otros créditos no comerciales concedidos a terceros incluidos los formalizados mediante efectos de giro, con vencimiento no superior a un año. Cuando los créditos hayan sido concertados con partes vinculadas, la inversión se reflejará en la cuenta 532. \r\n\r\nEn esta cuenta se incluirán también las donaciones y legados de capital, reintegrables o no, concedidas a la empresa, a cobrar a corto plazo, que se liquiden mediante la entrega de efectivo u otros instrumentos financieros, excluidas las subvenciones que deban registrarse en cuentas de los subgrupos 44 ó 47. \r\n\r\nFigurará en el activo corriente del balance. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará:\r\n    a1) A la formalización del crédito por el importe de éste, con abono, generalmente, a cuentas del                         subgrupo 57. \r\n    a2) Por el ingreso financiero devengado hasta alcanzar el valor de reembolso del crédito, con abono,           generalmente, a la cuenta 762.\r\n\r\nb) Se abonará por el reintegro, total o parcial o baja del activo, con cargo, generalmente, a cuentas del         subgrupo 57 y en caso de pérdidas a la cuenta 667. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('543','CREDITOS A CORTO PLAZO POR ENAJENACION DE INMOVILIZADO','N',0,'CREDITOS A CORTO PLAZO POR ENAJENACION DE INMOVILIZADO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Créditos a terceros, distintos de partes vinculadas, cuyo vencimiento no sea superior a un año, con origen en operaciones de enajenación de inmovilizado. Cuando los créditos por enajenación de inmovilizado hayan sido concertados con partes vinculadas, la inversión se reflejará en la cuenta 532. \r\n\r\nFigurará en el activo corriente del balance.\r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará:\r\n    a1) Por el importe de dichos créditos, excluidos los intereses que en su caso se hubieran acordado, con           abono a cuentas del grupo 2. \r\n    a2) Por el ingreso financiero devengado hasta alcanzar el valor de reembolso de crédito, con abono,               generalmente, a la cuenta 762.\r\n\r\nb) Se abonará por el reintegro, total o parcial o baja del activo, con cargo, generalmente, a cuentas del         subgrupo 57 y en caso de pérdidas a la cuenta 667\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('544','CREDITOS A CORTO PLAZO AL PERSONAL','N',0,'CREDITOS A CORTO PLAZO AL PERSONAL',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Créditos concedidos al personal de la empresa, que no tenga la calificación de parte vinculada, cuyo vencimiento no sea superior a un año. \r\n\r\nFigurará en el activo corriente del balance. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará:\r\n    a1) A la formalización del crédito por el importe de éste, con abono, generalmente, a cuentas del                         subgrupo 57. \r\n    a2) Por el ingreso financiero devengado hasta alcanzar el valor de reembolso del crédito, con abono,           generalmente, a la cuenta 762.\r\n\r\nb) Se abonará por el reintegro, total o parcial o baja del activo, con cargo, generalmente, a cuentas del         subgrupo 57 y en caso de pérdidas a la cuenta 667. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('545','DIVIDENDO A COBRAR','N',0,'DIVIDENDO A COBRAR',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Créditos por dividendos, sean definitivos o \"a cuenta\", pendientes de cobro. \r\n\r\nFigurará en el activo corriente del balance.\r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará por el importe devengado, con abono a la cuenta 760. \r\n\r\nb) Se abonará por el importe cobrado, con cargo, generalmente, a cuentas del subgrupo 57 y por la retención     soportada a la cuenta 473. \r\n\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('546','INTERESES A CORTO PLAZO DE VALORES REPRESENTATIVOS DE DEUDA','N',0,'INTERESES A CORTO PLAZO DE VALORES REPRESENTATIVOS DE DEUDA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Intereses a cobrar, con vencimiento no superior a un año, de valores representativos de deuda y de crédito. \r\n\r\nFigurará en el activo corriente del balance. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará: \r\n    a1) A la suscripción o compra de los valores, por el importe de los intereses explícitos corridos y no           vencidos, cuyo vencimiento no sea superior a un año, con abono, generalmente, a cuentas del           subgrupo 57. \r\n   a2) Por los intereses explícito devengados, cuyo vencimiento no sea superior a un año, con abono a la          cuenta 761.\r\n\r\nb) Se abonará:\r\n    b1) Por el importe de los intereses cobrados, con cargo a cuentas del subgrupo 57. \r\n    b2) A la enajenación, amortización o baja del activo de los valores, con cargo, generalmente, a cuentas del           subgrupo 57 y en caso de pérdidas a la cuenta 666.\r\n\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('547','INTERESES A CORTO PLAZO DE CREDITOS','N',0,'INTERESES A CORTO PLAZO DE CREDITOS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Intereses a cobrar, con vencimiento no superior a un año, de créditos.\r\n\r\nFigurará en el activo corriente del balance.\r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se cargará por los intereses explícitos devengados, cuyo vencimiento no sea superior a un año, con abono     a la cuenta 762.\r\n\r\nb) Se abonará:\r\n    b1) Por el importe de los intereses cobrados, con cargo a cuentas del subgrupo 57.\r\n    b2) Por el reintegro, total o parcial, o baja del activo, con cargo, generalmente a cuentas del subgrupo 57 y           en caso de pérdidas a la cuenta 667.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('548','IMPOSICIONES A CORTO PLAZO','N',0,'IMPOSICIONES A CORTO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Saldos favorables en Bancos e Instituciones de Crédito formalizados por medio de \"cuenta a plazo\" o similares, con vencimiento no superior a un año y de acuerdo con las condiciones que rigen para el sistema financiero. \r\n\r\nTambién se incluirán, con el debido desarrollo en cuentas de cuatro cifras, los intereses a cobrar, con vencimiento no superior a un año, de imposiciones a plazo. Cuando las imposiciones a plazo hayan sido concertadas con partes vinculadas, la inversión se reflejará en la cuenta 532. \r\n\r\nFigurará en el activo corriente del balance.\r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará a la formalización, por el importe entregado. \r\n\r\nb) Se abonará a la recuperación o traspaso de los fondos. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('549','DESEMBOLSOS PDTES. SOBRE PARTIC. PATRIMONIO NETO CORTO PLAZO','N',0,'DESEMBOLSOS PDTES. SOBRE PARTIC. PATRIMONIO NETO CORTO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Desembolsos pendientes, no exigidos, sobre participaciones en el patrimonio neto de empresas que no tengan la consideración de partes vinculadas, cuando se trate de inversiones financieras temporales. \r\n\r\nFigurará en el activo corriente del balance, minorando la partida en la que se contabilicen las correspondientes participaciones.\r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará a la adquisición o suscripción de las acciones, por el importe pendiente de desembolsar, con         cargo a la cuenta 540. \r\n\r\nb) Se cargará por los desembolsos que se vayan exigiendo, con abono a la cuenta 556 o a la cuenta 540 por     lo saldos pendientes, cuando se enajenen acciones no desembolsadas totalmente. .\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
