insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('550','TITULAR DE LA EXPLOTACION','N',0,'TITULAR DE LA EXPLOTACION',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Cuenta corriente mantenida con el titular de la explotación que expresa la relación existente entre el patrimonio personal del titular y la empresa a lo largo del ejercicio. \r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se abonará: \r\n    a1) Por los bienes y derechos traspasados a la empresa desde el patrimonio personal del titular. \r\n    a2) Por los resultados positivos no capitalizados, con cargo a la cuenta 129. \r\n\r\nb) Se cargará por los bienes y derechos retirados de la empresa con destino al patrimonio personal o al     consumo final del titular. \r\n\r\nc) Al final del ejercicio, se abonará o cargará, dependiendo de su saldo, con cargo o abono a la cuenta 102\r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
