insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('551','CUENTA CORRIENTE CON SOCIOS Y ADMINISTRADORES','N',0,'CUENTA CORRIENTE CON SOCIOS Y ADMINISTRADORES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Cuentas corrientes de efectivo con socios, administradores y cualquiera otra persona natural o jurídica que no sea Banco, banquero o Institución de Crédito, ni cliente o proveedor de la empresa, y que no correspondan a cuentas en participación. \r\n\r\nFigurará en el activo corriente del balance la suma de saldos deudores, y en el pasivo corriente la suma de saldos acreedores. \r\n\r\nCon carácter general, su movimiento es el siguiente:\r\n\r\nSe cargarán por las remesas o entregas efectuadas por la empresa y se abonarán por las recepciones a favor de la empresa, con abono y cargo, respectivamente, a cuentas del subgrupo 57. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
