insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('5530','SOCIOS DE SOCIEDAD DISUELTA','N',0,'SOCIOS DE SOCIEDAD DISUELTA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Cuenta corriente de la sociedad absorbente o la sociedad de nueva creación con los socios de la\r\nsociedad disuelta en una fusión.\r\n\r\na) Se abonará en el momento de la recepción del traspaso de los activos adquiridos y pasivos asumidos.\r\n\r\nb) Se cargará en el momento de la entrega a los socios de las acciones o participaciones emitidas, con abono a las cuentas 100 y 110 y, en su caso, a las correspondientes cuentas del subgrupo 57.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('5531','SOCIOS, CUENTA DE FUSION','N',0,'SOCIOS, CUENTA DE FUSION',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Cuenta corriente de las sociedades que se extinguen en una fusión.\r\n\r\na) Se cargará en el momento del traspaso a la sociedad absorbente o de nueva creación de los activos     adquiridos y pasivos asumidos.\r\n\r\nb) Se abonará, en el momento de la entrega a los socios de las acciones o participaciones emitidas, con cargo     a las cuentas correspondientes del patrimonio neto de la sociedad que se extingue.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
