insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('554','CUENTA CORRIENTE CON UNIONES TEMP. DE EMPRESAS Y COM. BIENES','N',0,'CUENTA CORRIENTE CON UNIONES TEMP. DE EMPRESAS Y COM. BIENES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Recoge los movimientos con las uniones temporales de empresas y comunidades de bienes en las que participe la empresa, derivados de aportaciones dinerarias, incluida la fundacional, devoluciones dinerarias de las uniones temporales de empresas, prestaciones recíprocas de medios, servicios y otros suplidos, y asignaciones de los resultados obtenidos en las mismas. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará por las remesas o entregas efectuadas por la empresa, con abono a las cuentas de los grupos     2, 5 y 7 que correspondan. \r\n\r\nb) Se abonará por las recepciones a favor de la empresa, con cargo a las cuentas 2, 5 y 6 que correspondan\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('555','PARTIDAS PENDIENTES APLICACION','N',0,'PARTIDAS PENDIENTES APLICACION',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Remesas de fondos recibidas cuya causa no resulte, en principio, identificable y siempre que no correspondan a operaciones que por su naturaleza deban incluirse en otros subgrupos. Tales remesas permanecerán registradas en esta cuenta el tiempo estrictamente necesario para aclarar su causa. \r\n\r\nFigurará en el pasivo corriente del balance. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se abonará por los cobros que se produzcan, con cargo a cuentas del subgrupo 57. \r\n\r\nb) Se cargará al efectuar la aplicación, con abono a la cuenta a que realmente corresponda. \r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
