insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('5580','SOCIOS DESEMBOLSOS EXIGIDOSSOBRE ACCIONES O PART.ORDINARIAS','N',0,'SOCIOS DESEMBOLSOS EXIGIDOSSOBRE ACCIONES O PART.ORDINARIAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Capital social escriturado, pendiente de desembolso, cuyo importe ha sido exigido a los accionistas o partícipes. \r\n\r\nSe desglosarán, con el debido desarrollo en cuentas de cuatro cifras, los desembolsos pendientes en mora. \r\n\r\nFigurará en el activo corriente del balance. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargará por los desembolsos exigidos, con abono a cuentas del subgrupo 1030. \r\n\r\nb) Se abonará en la medida en que dichos desembolsos se vayan efectuando, con cargo a cuentas del     subgrupo 57.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('5585','SOCIOS DESEMB. EXIGIDOS ACCIONES O PART. COMO PASIV. FINANC.','N',0,'SOCIOS DESEMB. EXIGIDOS ACCIONES O PART. COMO PASIV. FINANC.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Importe correspondientes a las acciones o participaciones consediradas como pasivos financieros, emitidas y suscritas, pendientes de desembolso, cuyo importe ha sido exigido a los suscriptores.\r\n\r\nSe desglosarán, con el debido desarrollo en cuantes de cinco cifras, los desembolsos pendientes en mora.\r\n\r\nFigurará en el pasivo no corriente del balance, con signo negativo, minorando el epígrafe \"Deudas a largo plazo con características especiales\"\r\n\r\nSu movimiento es el siguiente:\r\n\r\na) Se cargará por los desembolsos exigidos, con abono a la cuenta 153.\r\n\r\nb) Se abonará en la medida en que dichos desembolsos vayan efectuando, con cargo a las cuentas del subgrupo 57.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('559','DERIVADOS FINANCIEROS A CORTO PLAZO','N',0,'DERIVADOS FINANCIEROS A CORTO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Importe correspondiente a las operaciones con derivados financieros cuyo plazo de liquidación no sea superior a un año. En particular, se recogerán en esta cuenta las primas pagadas o cobradas en operaciones con opciones, los depósitos en garantía por operaciones con futuros, así como, con carácter general, las variaciones en el valor razonable de los instrumentos financieros derivados con los que opere la empresa: opciones, futuros, permutas financieras, compraventa a plazo de moneda extranjera, etc.\r\n\r\nTambién se incluyen los derivados implícitos de instrumentos financieros híbridos adquiridos, emitidos o asumidos, que cumplan los criterios para su inclusión en esta cuenta, creándose en caso necesario cuentas de cuatro o más cifras que identifiquen que se trata de un derivado implícito.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('5590','ACTIVOS POR DERIVADOS FINANCIEROS C.PLAZO, INST. COBERTURA','N',0,'ACTIVOS POR DERIVADOS FINANCIEROS A CORTO PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Importe correspondiente a las operaciones con derivados financieros a corto plazo, con valoración favorable para la empresa. \r\n\r\nFigurará en el activo corriente del balance. \r\n\r\na) Se cargará: \r\n    a1) Por las cantidades satisfechas en el momento de la contratación, con abono, generalmente, a cuentas           del subgrupo 57. \r\n    a2) Por las variaciones en su valor razonable, con cargo a la cuenta 7630. \r\n\r\nb) Se abonará: \r\n    b1) Por el importe recibido en el momento de la liquidación, con cargo, generalmente, a cuentas del                      subgrupo 57. \r\n    b2) Por las pérdidas que se generen en el ejercicio hasta el límite del importe por el que figurara registrado el           derivado en el activo en el ejercicio anterior, con cargo a la cuenta 6630.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('5593','ACTIVOS POR DERIVADOS FINANCIEROS C.PLAZO, CARTERA NEGOCIAC.','N',0,'ACTIVOS POR DERIVADOS FINANCIEROS C.PLAZO, INST. COBERTURA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Figurará en el activo corriente del balance.\r\n\r\na) Se cargará por las cantidades satisfechas en el momento de la contratación, con abono, generalmente a cuentas del subgrupo 57.\r\n\r\nb) Cuando el derivado se utilice como instrumento de cobertura, en una cobertura de valor razonable:\r\n    b1) Se cargará por las ganancias que se generen en el ejercicio de aplicar las reglas que rigen la           contabilidad de coberturas, con abno a una cuenta que se imputará a la cuenta de pérdidas y           ganancias en la misma partida en la que se incluyan las pérdidas que se generen en las partidas           cubiertas al valorar el riesgo cubierto por su valor razonable.\r\n   b2) Se abonará: \r\n         i) Por las pérdidas que se generen en el ejercicio al aplicar las reglas que rigen la contabilidad de             coberturas, hasta el límite del importe por el que figurara registrado el derivado en el activo en el             ejercicio anterior, con cargo a una cuenta que se imputará en la cuenta de pérdidas y ganancias en la             misma partida en la que se incluyan las ganancias que se generen en las partidas cubiertas al valorar             el riesgo cubierto por su valor razonable.\r\n        ii) En el momento en que se adquiera el activo o asuma el pasivo cubiertos, con cargo a las cuentas en             que se contabilicen dichos elementos patrimoniales.\r\n\r\nc) Cuando el derivado se utilice como instrumento de cobertura, en otras operaciones de cobertura, por la parte eficaz, se cargará o abonará, por la ganancia o pérdida que se generen en el ejercicio de aplicar las reglas que rigen la contabilidad de coberturas, con abono o cargo, a las cuentas del subgrupo 91 y 81, respectivamente, y por la parte ineficaz, a las cuentas 7633 y 6633.\r\n\r\nd) Se abonará por el importe recibido en el momento de la liquidaciópn, con cargo generalmente a cuentas del subgrupo 57.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('5595','PASIVOS DERIVADOS FINANCIEROS CORTO PLAZ0, INSTRUM. COBERTUR','N',0,'PASIVOS DERIVADOS FINANCIEROS CORTO PLAZ0, CARTERA NEGOCIAC.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Figurará en el pasivo corriente del balance.\r\n\r\na) Se abonará:\r\n    a1) Por el importe recibido en el momento de la contratación, con cargo, generalmente, a cuentas del           subgrupo 57.\r\n    a2) Por las pérdidas que se generen en el ejercicio, con cargo a la cuenta 6630.\r\n\r\nb) Se cargará:\r\n    b1) Por las ganancias que se generen en el ejercicio hasta el límite del importe por el que se figurara           registrado el derivado del pasivo en el ejercicio anterior, cor abono a la cuenta 7630.\r\n    b2) Por las cantidades satisfechas en el momento de la liquidación, con abono, generalmente, a cuentas           del subgrupo 57.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('5598','PASIVOS DERIVADOS FINANCIEROS CORTO PLAZO, CARTERA NEGOCIAC.','N',0,'PASIVOS DERIVADOS FINANCIEROS CORTO PLAZO, INST. DE COBERTUR',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Figurará en el pasivo corriente del balance.\r\n\r\na) Se abonará por el importe recibido en el momento de la contratación, con cargo, generalmente, a cuentas del subgrupo 57.\r\n\r\nb) Cuando el derivado se utilice como instrumento de cobertura, eun una cobertura de valor razonable:\r\n    b1) Se cargará:\r\n    i) Por las ganancias que se generen en el ejercicio al aplicar las reglas que rigen en la contabilidad de        coberturas, hasta el límite del importe por el que figurara registrado el derivado en el pasivo en el ejercicio        anterior, con abono a una cuenta que se imputará a la cuenta de pérdidas y ganancias en la misma        partida en la que se incluyen las pérdidas que se generen en las partidas cubiertas al valorar el riesgo        cubierto por su valor razonable.\r\n   ii) En el momento en que se adquiera el activo o se asuma el pasivo cubiertos, con abono a las cuentas en        que se contabilicen dichos elementos patrimoniales.\r\n  \r\n   b2) Se abonará por las pérdidas que se generen en el ejercicio al aplicar las reglas que rigen la contabilidad          de coberturas, con cargo a una cuenta que se imputará a la cuenta de pérdidas y ganancias en la           misma partida en la que se incluyan las ganancias que se generen en las partidas cubiertas al valorar el           riesgo cubierto de su valor razonable.\r\n\r\nc) Cuando el derivado se utilice como instrumento de cobertura, en otras operaciones de cobertura, por la parte eficaz, se cargará o abonará, por la ganancia o pérdida que se generen en el ejercicio al aplicar las regla que rigen la contabilidad de coberturas, con abono o cargo, a las cuentas del subgrupo 91 y 81, respectivamente, y por la parte ineficas, a las cuentas 7633 y 6633.\r\n\r\nd) Se cargará por las cantidades satisfechas en el momento de la liquidación, con abono, generalmente, a cuentas del subgrupo 57.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
