insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('574','BANCOS E INSTITUCIONES DE CREDITO, CUENTAS DE AHORRO, EUROS','N',0,'BANCOS E INSTITUCIONES DE CREDITO, CUENTAS DE AHORRO, EUROS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Saldos a favor de la empresa, en cuentas corrientes a la vista y de ahorro de disponibilidad inmediata en Bancos e Instituciones de Crédito, entendiendo por tales Cajas de Ahorros, Cajas Rurales y Cooperativas de Crédito para los saldos situados en España y entidades análogas si se trata de saldos situados en el extranjero. \r\n\r\nSe excluirán de contabilizar en este subgrupo los saldos en los Bancos e instituciones citadas cuando no sean de disponibilidad inmediata, así como los saldos de disposición inmediata si no estuvieran en poder de Bancos o de las instituciones referidas. También se excluirán los descubiertos bancarios que figurarán en todo caso en el pasivo corriente del balance. \r\n\r\nFigurarán en el activo corriente del balance. \r\n\r\nSu movimiento es el siguiente: \r\n\r\na) Se cargarán por las entregas de efectivo y por las transferencias, con abono a la cuenta que ha de servir     de contrapartida, según sea la naturaleza de la operación que provoca el cobro. \r\n\r\nb) Se abonarán por la disposición, total o parcial, del saldo, con cargo a la cuenta que ha de servir de     contrapartida, según sea la naturaleza de la operación que provoca el pago\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
