insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('576','INVERSIONES A CORTO PLAZO DE GRAN LIQUIDEZ','N',0,'INVERSIONES A CORTO PLAZO DE GRAN LIQUIDEZ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Inversiones financieras convertibles en efectivo, con un vencimiento no superior a tres meses, desde la fecha de adquisición, que no tengan riesgos significativos de cambio de valor y que formen parte de la política de gestión normal de la tesorería de la empresa.\r\n\r\nFigurará en el activo corriente del balance.\r\n\r\nSu movimiento es el siguiente:\r\n\r\nSe cargará a al entrada de las inversiones financieras y se abonará a su salida, con abono y cargo a las cuentas que han de servir de contrapartida.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('58','ACTIVOS NO CORRIENTES MANTENIDOS PARA VENTA Y PASIVOS ASOC.','N',0,'ACTIVOS NO CORRIENTES MANTENIDOS PARA VENTA Y PASIVOS ASOC.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Activos no corrientes y otros activos y pasivos incluidos en un grupo enajenable de elementos, cuya recuperación se espera realizar fundamentalmente a través de su venta, en lugar de por su uso continuado, incluidos los que formen parte de una operación interrumpida que se hubiera clasificado como mantenida para la venta.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('580','INMOVILIZADO','N',0,'INMOVILIZADO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Estas cuentas figurarán en el activo corriente del balance.\r\n\r\nSu movimiento, generalmente, es el siguiente:\r\n\r\na) Se cargarán:\r\n    a1) En el momento en que se cumplan las condiciones para su clasificación, de acuerdo con lo dispuesto           en las normas de registro y valoración contenidas en la segunda parte de este texto, con abono a las                respectivas cuentas del activo corriente y no corriente.\r\n    a2) En el caso de activos financieros que, a efectos de su valoración, estuvieran clasificados en la                     categoría de \"Activos financieros mantenidos para negociar\" o en la de \"Otros activos financieros a                   valor razonable con cambios en la cuenta de pérdidas y ganancias \", por las variaciones en su valor                  razonable, con abono a la cuenta 763.\r\n    a3) En el caso de activos financieros que, a efectos de su valoración, estuvieran clasificados en la                         categoría de \"Activos financieros disponibles para la venta\", por las variaciones en su valor razonable,             con abono a la cuenta 960, salvo la parte correspondiente a diferencias de cambio en partidas           monetarias que se registrará con abono a la cuenta 768.\r\n   a4) En su caso, por el ingreso financiero devengado, con abono a la cuenta que corresponda del subgrupo          76.\r\n\r\nb) Se abonarán:\r\n    b1) En el momento en que se produzca la enajenación o disposición por otra vía del activo no corriente o               grupo enajenable de elementos, con cargo, generalmente, acuentas del subgrupo 57 y en caso de                   pérdidas a la cuenta del subgrupo 67 que corresponda a la naturaleza del activo\r\n   b2) En el caso de activos financieros que, a efectos de su valoración, estuvieran clasificados en la                         categoría de \"Activos financieros mantenidos para negociar\" o en la de \"Otros activos financieros a          valor razonable con cambios en la cuenta de pérdidas y ganancias\" , por las variaciones en su valor          razonable, con cargo a la cuenta 663.\r\n   b3) En el caso de activos financieros que, a efectos de su valoración, estuvieran clasificados en la                   categoría de \"Activos financieros disponibles para la venta\", por las variaciones en su valor razonable,              con cargo a la cuenta 860, salvo la parte correspondiente a diferencias de cambio en partidas monetarias      que se registrará con cargo a la cuenta 668.\r\n   b4) Si el activo no corriente o grupo enajenable de elementos dejara de cumplir los requisitos para su                      clasificación como mantenido para la venta de acuerdo con lo dispuesto en las normas de registro y                  valoración contenidas en la segunda parte de este texto, con cargo a las respectivas cuentas del activo          corriente y no corriente.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
