ra de cumplir los requisitos para su clasificación como                     mantenido para la venta de acuerdo con lo dispuesto en las normas de registro y valoración contenidas            en la segunda parte de este texto, con abono a las respectivas cuentas del pasivo corriente y no                     corriente.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('59','DETERIORO DE VALOR DE INSTRUMENTOS FINANCIEROS','N',0,'DETERIORO DE VALOR DE INSTRUMENTOS FINANCIEROS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Expresión contable de las correcciones de valor motivadas por las pérdidas por deterioro de los activos incluidos en el grupo 5. En el supuesto de posteriores recuperaciones de valor, de acuerdo con lo que al respecto disponen las correspondientes normas de registro y valoración, las pérdidas por deterioro reconocidas deberán reducirse hasta su total recuperación, cuando así proceda de acuerdo con lo dispuesto en dichas normas. \r\n\r\nLas cuentas de este subgrupo figurarán en el activo corriente del balance minorando la partida en la que figure el correspondiente elemento patrimonial. \r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
