insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('761','INGRESOS DE VALORES REPRESENTATIVOS DE DEUDA','N',0,'INGRESOS DE VALORES REPRESENTATIVOS DE DEUDA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Intereses de valores de renta fija a favor de la empresa, devengados en el ejercicio.\r\n\r\nSe abonará:\r\n\r\na) Al devengo de los intereses, tanto implícitos como explícitos, por el íntegro de los mismos, con cargo a    cuentas de los subgrupos 24, 25, 53 ó 54 y, en su caso, a la cuenta 473.\r\n\r\nb) Por el reconocimiento en la cuenta de pérdidas y ganancias, a lo largo de su vida residual, del saldo     positivo acumulado en el patrimonio neto de un activo financiero disponible para la venta que se haya     reclasificado como inversión mantenida hasta el vencimiento en los términos establecidos en las normas de     registro y valoración, con cargo a la cuenta 802.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
