insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('800','PERDIDAS EN ACTIVOS FINANCIEROS DISPONIBLES PARA LA VENTA','N',0,'PERDIDAS EN ACTIVOS FINANCIEROS DISPONIBLES PARA LA VENTA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se cargará por las variaciones negativas en el valor razonable de los activos financieros clasificados como disponibles para la venta, incluidas las que se produzcan en caso de reclasificación, con abono a las cuentas de los correspondientes elementos patrimoniales.\r\n\r\nb) Se abonará, al cierre del ejercicio, con abono a la cuenta 133.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('802','TRANSFERENCIA DE BENEFICIOS ACTIVOS FINANC. DISPONIBLE VENTA','N',0,'TRANSFERENCIA DE BENEFICIOS ACTIVOS FINANC. DISPONIBLE VENTA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se cargará\r\n    a1) En el momento en que se produzca la baja o enajenación del activo financiero disponible para la venta,           incluidos los que hayan sido objeto de reclasificación, por el saldo positivo acumulado en el patrimonio           neto con abono a la cuenta 7632.\r\n\r\na2) En caso de reclasificación en una inversión mantenida hasta el vencimiento, por el saldo positivo       acumulado en el patrimonio neto que se reconoce en la cuenta de pérdidas y ganancias, a lo largo de su       vida residual, como un incremento de los ingresos financieros en los términos establecidos en la norma de registro y valoración, con abono a la cuenta 761.\r\n\r\nb) Se abonará, al cierre del ejercicio, con cargo a la cuenta 133.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('81','GASTOS EN OPERACIONES DE COBERTURA','N',0,'GASTOS EN OPERACIONES DE COBERTURA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('810','PERDIDAS POR COBERTURAS DE FLUJOS DE EFECTIVO','N',0,'PERDIDAS POR COBERTURAS DE FLUJOS DE EFECTIVO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se cargará, por el menor valor de los siguientes importes: el resultado negativo acumulado del instrumento     de cobertura desde el inicio de la cobertura o el cambio acumulado en el valor razonable de los flujos de     efectivo futuros esperados de la partida cubierta desde el inicio de la cobertura; con abono, generalmente,     a las cuentas 175, 255 ó 559.\r\n\r\nb) Se abonará, al cierre del ejercicio, con cargo a la cuenta 1340.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('811','PERDIDAS POR COBERTURAS DE INVERS. NETAS EN EL EXTRANJERO','N',0,'PERDIDAS POR COBERTURAS DE INVERS. NETAS EN EL EXTRANJERO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se cargará por el importe de la cobertura que se determine eficaz, con abono, generalmente, a las cuentas 175, 255 ó 559.\r\n\r\nb) Se abonará, al cierre del ejercicio, con cargo a la cuenta 1341.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('812','TRANSF. DE BENEFICIOS POR COBERTURAS DE FLUJOS EFECTIVO','N',0,'TRANSF. DE BENEFICIOS POR COBERTURAS DE FLUJOS EFECTIVO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'a) Se cargará:\r\n\r\na1) Cuando la cobertura de una transacción prevista o de cobertura del riesgo de tipo de cambio de un compromiso en firme, diera lugar al reconocimiento posterior de un activo financiero o pasivo financiero, por el importe positivo reconocido directamente en el patrimonio neto, a medida que dicho activo o pasivo afecte al\r\nresultado del ejercicio, con abono a la cuenta que corresponda en función de la naturaleza del gasto que genere la partida cubierta .\r\n\r\na2) Cuando la cobertura de una transacción prevista o de cobertura del riesgo de tipo de cambio de un compromiso en firme, diera lugar al reconocimiento de un activo o pasivo no financiero, por el importe positivo reconocido directamente en el patrimonio neto, con abono, a la cuenta del correspondiente elemento\r\npatrimonial.\r\n\r\na3) Cuando la cobertura de una transacción prevista o de cobertura del riesgo de tipo de cambio de un compromiso en firme, diera lugar a la baja de un activo o pasivo no financiero, por el importe positivo reconocido directamente en el patrimonio neto, con abono a la cuenta que corresponda a la naturaleza del gasto que genere la partida cubierta.\r\n\r\na4) Por el importe de la ganancia directamente reconocida en el patrimonio neto, si la empresa no espera que la transacción prevista tenga lugar, con abono a la cuenta 7633.\r\n\r\nb) Se abonará, al cierre del ejercicio, con cargo a la cuenta 1340.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('813','TRANSF. BENEFICIOS POR COBERTURAS INVERS. NETAS EXTRANJERO','N',0,'TRANSF. BENEFICIOS POR COBERTURAS INVERS. NETAS EXTRANJERO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se cargará, en el momento de la venta o disposición por otra vía de la inversión neta en un negocio en el extranjero, por el importe del beneficio del instrumento de cobertura imputado directamente al patrimonio neto, con abono a la cuenta 768.\r\n\r\nb) Se abonará, al cierre del ejercicio, con cargo a la cuenta 1341.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('82','GASTOS POR DIFERENCIAS DE CONVERSION','N',0,'GASTOS POR DIFERENCIAS DE CONVERSION',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('820','DIFERENCIAS DE CONVERSION NEGATIVAS','N',0,'DIFERENCIAS DE CONVERSION NEGATIVAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se cargará, por el efecto neto deudor derivado de la diferencia de valor de los activos y pasivos valorados en moneda funcional distinta a la de presentación, como consecuencia de la conversión a la moneda de presentación, con cargo y/o abono a las respectivas cuentas que representan dichos activos y pasivos.\r\n\r\nb) Se abonará, al cierre del ejercicio, con cargo a la cuenta 135','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('821','TRANSFERENCIA DE DIFERENCIAS DE CONVERSION POSITIVAS','N',0,'TRANSFERENCIA DE DIFERENCIAS DE CONVERSION POSITIVAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se cargará, en el momento de baja, enajenación o cancelación del elemento patrimonial asociado, con abono a la cuenta 768.\r\n\r\nb) Se abonará, al cierre del ejercicio, con cargo a la cuenta 135.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('83','IMPUESTO SOBRE BENEFICIOS','N',0,'IMPUESTO SOBRE BENEFICIOS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
