insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('860','PERD. ACTIVOS NO CORRITES. Y GRUPOS ENAJ.  ELEMT. PARA VENTA','N',0,'PERD. ACTIVOS NO CORRITES. Y GRUPOS ENAJ.  ELEMT. PARA VENTA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Con carácter general, su movimiento es el siguiente:\r\n\r\na) Se cargará por las variaciones negativas en el valor razonable de los activos no corrientes mantenidos para la venta, y de los activos y pasivos directamentente asociados clasificados en un grupo enajenable de elementos mantenidos para la venta, que deban valorarse por el valor razonable con cambios en el patrimonio neto de acuerdo con lo dispuesto en las normas de registro y valoración, con abno a cuentas del subgrupo 58.\r\n\r\nb) Se abonará, al cierre del ejercicio, con cargo a la cuenta 136.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('862','TRANSF. BENEFICIOS ACTIVOS NO CTES. Y GRUPOS ENAJ.ELEMT.VENT','N',0,'TRANSF. BENEFICIOS ACTIVOS NO CTES. Y GRUPOS ENAJ.ELEMT.VENT',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Con caracter general, su movimiento es el siguiente:\r\n\r\na) Se cargará en el momento en que se produzca la baja o enajenación del activo no corriente mantenido para la venta, o del activo o pasivo directamente asociado clasificado en un grupo enajenable de elementos mantenidos para la venta, que deba valorarse por el valor razonable con cambios en el patrimonio neto de acuerdo con lo dispuesto en las normas de registro y valoración, con abono, generalmente a la cuenta 7632.\r\n\r\nb) Se abonará, al cierre del ejercicio, con cargo a la cuenta 136.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('89','DETERIORO DE ACTIVOS FINANCIEROS','N',0,'DETERIORO DE ACTIVOS FINANCIEROS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Las cuentas de este subgrupo recogerán las pérdidas por deterioro de participaciones en empresas del grupo, multigrupo o asociadas, cuando se hubieran realizado inversiones previas, y las mismas se hubieran valorado a valor razonable imputando las diferencias de valoración directamente al patrimonio neto, incluidos los activos que se clasifiquen como activos no corrientes mantenidos para la venta o se encuentren incluidos en un grupo enajenable de elementos mantenidos para la venta. Todo ello, de acuerdo con lo que al respecto disponen las correspondientes normas de registro y valoración.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('891','DETERIORO DE PARTIC. PATRIMONIO Y VALORES DEUDAS EMP.GRUPO','N',0,'DETERIORO DE PARTIC. PATRIMONIO Y VALORES DEUDAS EMP.GRUPO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se cargará en el momento en que se produzca el deterioro del valor del activo financiero, hasta el limite de los ajustes valorativos previos, con abono a las cuentas 240 ó 530. \r\n\r\nb) Se abonará, al cierre del ejercicio, con cargo a la cuenta 133.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
