insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('90','INGRESOS FINANCIEROS POR VALORACIÓN DE ACTIVOS Y PASIVOS','N',0,'INGRESOS FINANCIEROS POR VALORACIÓN DE ACTIVOS Y PASIVOS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('900','BENEFICIOS EN ACTIVOS FINANCIEROS DISPONIBLES PARA LA VENTA','N',0,'BENEFICIOS EN ACTIVOS FINANCIEROS DISPONIBLES PARA LA VENTA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se abonará por las variaciones positivas en el valor razonable de los activos financieros clasificados como disponibles para la venta, incluidas las que se produzcan en caso de reclasificación, con cargo a las cuentas de los correspondientes activos financieros.\r\n\r\nb) Se cargará, al cierre del ejercicio, con abono a la cuenta 133','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('902','TRANSFERENCIA DE PERDIDAS DE ACTIVOS FINANC. PARA VENTA','N',0,'TRANSFERENCIA DE PERDIDAS DE ACTIVOS FINANC. PARA VENTA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'a) Se abonará:\r\n    a1) En el momento en que se produzca la baja o enajenación del activo financiero disponible para la venta,            incluidos los que hayan sido objeto de reclasificación, por el saldo negativo acumulado en el patrimonio            neto con cargo a la cuenta 6632. \r\n\r\n    a2) En el momento en que se produzca el deterioro del instrumento financiero, por el saldo negativo                     acumulado en el patrimonio neto con cargo a las cuentas de los correspondientes instrumentos de           deuda o a la cuenta 696 en el caso de inversiones en instrumentos de patrimonio.\r\n\r\n   a3) En caso de reclasificación en una inversión mantenida hasta el vencimiento, por el saldo negativo                   acumulado en el patrimonio neto que se reconoce en la cuenta de pérdidas y ganancias a lo largo de su          vida residual, con una minoración de los ingresos financieros en los términos establecidos en la norma de          registro y valoración, con cargo a la cuenta 761.\r\n\r\nb) Se cargará, al cierre del ejercicio, con abono a la cuenta 133.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('903','TRANSFERENCIA DE PERDIDAS DE PASIVOS FINANC. PARA VENTA','N',0,'TRANSFERENCIA DE PERDIDAS DE PASIVOS FINANC. PARA VENTA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se abonará en el momento en que se produzca la baja o enajenación del pasivo financiero por el saldo negativo acumulado en el patrimonio neto con cargo a la cuenta 6632.\r\n\r\nb) Se cargará, al cierre del ejercicio, con abono a la cuenta 133.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('91','INGRESOS EN OPERACIONES DE COBERTURA','N',0,'INGRESOS EN OPERACIONES DE COBERTURA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('910','BENEFICIOS POR COBERTURAS DE FLUJOS DE EFECTIVO','N',0,'BENEFICIOS POR COBERTURAS DE FLUJOS DE EFECTIVO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se abonará por el importe derivado de considerar el menor de los siguientes importes: el resultado positivo acumulado del instrumento de cobertura desde el inicio de la cobertura o el cambio acumulado en el valor razonable de los flujos de efectivo futuros esperados de la partida cubierta desde el inicio de la cobertura; con cargo, generalmente, a las cuentas 175, 255 ó 559.\r\n\r\nb) Se cargará al cierre del ejercicio, con abono a la cuenta 1340.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('911','BENEFICIOS POR COBERTURAS DE INVERSION EN EL EXTRANJERO','N',0,'BENEFICIOS POR COBERTURAS DE INVERSION EN EL EXTRANJERO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se abonará por el resultado positivo en el importe de la cobertura que se determine eficaz, con cargo, generalmente, a las cuentas 175, 255 ó 559.\r\n\r\nb) Se cargará, al cierre del ejercicio, con abono a la cuenta 1341.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('912','TRANSFERENCIA DE PERDIDAS POR COBERTURAS DE FLUJO EFECTIVO','N',0,'TRANSFERENCIA DE PERDIDAS POR COBERTURAS DE FLUJO EFECTIVO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se abonará:\r\n\r\na1) Cuando la cobertura de una transacción prevista o de cobertura del riesgo de tipo de cambio de un       compromiso en firme, diera lugar al reconocimiento posterior de un activo o pasivo financiero, por el       importe negativo reconocido directamente en el patrimonio neto, a medida que dicho activo o pasivo       afecte al resultado del ejercicio, con cargo a la cuenta que corresponda a la naturaleza del ingreso que       genere la partida de cubierta.\r\na2) Cuando la cobertura de una transacción prevista o de cobertura del riesgo de tipo de cambio de un       compromiso en firme, diera lugar al reconocimiento de un activo o pasivo no financiero, por el importe       negativo reconocido directamente en el patrimonio neto, con cargo, a la cuenta del correspondiente       elemento patrimonial.\r\na3) Cuando la cobertura de una transacción prevista o de cobertura del riesgo de tipo de cambio de un       compromiso en firme, diera lugar a la baja de un activo o pasivo no financiero, por el importe negativo       reconocido directamente en el patrimonio neto, con cargo a la cuenta que corresponda a la naturaleza del       ingreso que genere la partida de cubierta.\r\na4) Cuando en la cobertura de un activo o un pasivo reconocido, la partida cubierta afecte al resultado, con cargo a una cuenta que se imputará a la cuenta de pérdidas y ganancias en la misma partida en la que se incluye la ganancia que se genere en la partida cubierta.\r\na5) Por el importe de la pérdida directamente reconocida en el patrimonio neto que la empresa no espere       recuperar, con cargo a la cuenta 6633. \r\n\r\nb) Se cargará, al cierre del ejercicio, con abono a la cuenta 1340.\r\n','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('913','TRANSFERENCIA PERDIDAS POR COBERTURAS INVERSION EXTRANJERO','N',0,'TRANSFERENCIA PERDIDAS POR COBERTURAS INVERSION EXTRANJERO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se abonará, en el momento de la venta o disposición por otra vía de la inversión neta en un negocio en el extranjero, por el importe de la pérdida del instrumento de cobertura imputada directamente al patrimonio neto, con cargo a la cuenta 668.\r\n\r\nb) Se cargará, al cierre del ejercicio, con abono a la cuenta 1341.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
