insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('920','DIFERENCIAS DE CONVERSION POSITIVAS','N',0,'DIFERENCIAS DE CONVERSION POSITIVAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se abonará, por el efecto neto acreedor derivado de la diferencia de valor de los activos y pasivos     valorados en moneda funcional distinta a la de presentación, como consecuencia de la conversión a la     moneda de presentación, con cargo y/o abono a las respectivas cuentas del balance que representan     dichos activos y pasivos.\r\n\r\nb) Se cargará, al cierre del ejercicio, con abono a la cuenta 135.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('921','TRANSFERENCIA DE DIFERENCIAS DE CONVERSION NEGATIVAS','N',0,'TRANSFERENCIA DE DIFERENCIAS DE CONVERSION NEGATIVAS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se abonará, en el momento de baja, enajenación o cancelación del elemento patrimonial asociado, con cargo a la cuenta 668.\r\n\r\nb) Se cargará, al cierre del ejercicio, con abono a la cuenta 135.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
