insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('95','INGR. GANANC. ACTUARIALES Y AJUSTES ACTIVOS RETRIB. L.PLAZO','N',0,'INGR. GANANC. ACTUARIALES Y AJUSTES ACTIVOS RETRIB. L.PLAZO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('950','GANANCIAS ACTUARIALES','N',0,'GANANCIAS ACTUARIALES',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'a) Se abonará, al cierre del ejercicio por la ganancia actuarial producida por la disminución en el valor actual     de las obligaciones por sistemas de prestación definida o bien por el aumento en el valor razonable de los     activos relacionados con éstos, con cargo a las cuentas 140 ó 257.\r\n\r\nb) Se cargará, al cierre del ejercicio, con abono a la cuenta 115.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('951','AJUSTES POSITIVOS ACTIVOS RETRIBUC. L PLAZO PREST. DEFINIDA','N',0,'AJUSTES POSITIVOS ACTIVOS RETRIBUC. L PLAZO PREST. DEFINIDA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'a) Se abonará, al cierre del ejercicio por el ajuste positivo que proceda realizar de acuerdo con lo dispuesto en     las normas de registro y valoración en los activos por retribuciones post-empleo a largo plazo al personal de     prestación definida, con cargo a las cuentas 140 ó 257.\r\n\r\nb) Se cargará, al cierre del ejercicio, con abono a la cuenta 115.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('96','INGRESOS POR ACTIVOS NO CORRIENTES EN VENTA','N',0,'INGRESOS POR ACTIVOS NO CORRIENTES EN VENTA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('960','BENEF.ACTIVOS NO CTES. Y GRUPOS ENAJ. ELEMNT. MANT. VENTA','N',0,'BENEF.ACTIVOS NO CTES. Y GRUPOS ENAJ. ELEMNT. MANT. VENTA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Con caracter general, su movimiento es el siguiente:\r\n\r\na) Se abonará por las variaciones positivas en el valor razonable de los activos no corrientes mantenidos para la venta, y de activos y pasivos directamente asociados clasificados en un grupo enajenable de elementos mantenidos para la venta, que deban valorarse por el valor razonable con cambios en el patrimonio neto de acuerdo con lo dispuesto en las normas de registro y valoración, con cargo a cuentas del subgrupo 58.\r\n\r\nb) Se cargará, al cierre del ejercicio, con abono a la cuenta 136.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('962','TRANSF. PERDIDA ACTIVOS NO CTES. Y GRUPOS ENAJ. PARA LA VENT','N',0,'TRANSF. PERDIDA ACTIVOS NO CTES. Y GRUPOS ENAJ. PARA LA VENT',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Con caracter general, su movimiento es el siguiente:\r\n\r\na) Se abonará:\r\n   a1) En el momento en que se produzca la baja o enajenación del activo no corriente mantenido para la          venta, o del activo o pasivo directamente asociado clasificado en un grupo enajenable de elementos          mantenidos para la venta, que deba valorarse por el valor razonable con cambios en el patrimonio neto          de acuerdo con lo dispuesto en las normas de registro y valoración, con cargo, generalmente, a la          cuenta 6632.\r\n   a2) En el momento en que se produzca el deterioro del activo no corriente mantenido para la venta, o del          activo directamente asociado clasificado en un grupo enajenable de elementos mantenidos para la          venta, que deba valorarse por el valor razonable con cambios en el patrimonio neto de acuerdo con lo          dispuesto en las normas de registro y valoración, por el saldo negativo acumulado en el patrimonio neto,          con cargo a las cuentas de los correspondientes instrumentos de deuda o a la cuenta 698 en el caso de          inversiones en instrumentos de patrimonio.\r\n\r\nb) Se cargará, al cierre del ejercicio, con abono a la cuenta 136.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('99','INGR. PARTIC.  PATRIMONIO EMPR. GRUPO CON AJUSTES VAL.NEGAT.','N',0,'INGR. PARTIC.  PATRIMONIO EMPR. GRUPO CON AJUSTES VAL.NEGAT.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Las cuentas de este subgrupo recogerán la recuperación de los ajustes valorativos por reducciones de valor imputados directamente en el patrimonio neto, cuando se hubieran realizado inversiones previas a la consideración de las participaciones en el patrimonio como de empresas del grupo, multigrupo y asociadas. También se recogerán las transferencias a la cuenta de pérdidas y ganancias de los citados ajustes valorativos en caso de deterioro. Todo ello, de acuerdo con lo que al respecto disponen las correspondientes normas de registro y valoración.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
insert  into `cuentas`(`codmacta`,`nommacta`,`apudirec`,`model347`,`razosoci`,`dirdatos`,`codposta`,`despobla`,`desprovi`,`nifdatos`,`maidatos`,`webdatos`,`obsdatos`,`pais`,`entidad`,`oficina`,`CC`,`cuentaba`,`numpoliz`,`fecsolic`,`credisol`,`fecconce`,`credicon`,`observa`,`fecbloq`,`forpa`,`ctabanco`,`grupotesoreria`,`fecbajcre`,`iban`) values ('991','RECUPERACION AJUSTES VALORAT. NEGATIVOS PREVIOS, EMP. GRUPO','N',0,'RECUPERACION AJUSTES VALORAT. NEGATIVOS PREVIOS, EMP. GRUPO',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Su movimiento es el siguiente:\r\n\r\na) Se abonarán en el momento en que el importe recuperable sea superior al valor contables de las inversiones, hasta el límite de los ajustes valorativos negativos previos, con cargo a las cuentas 240 ó 530.\r\n\r\nb) Se cargarán, al cierre del ejercicio, con abono a la cuenta 133.','ESPA?A',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
